INSERT INTO `mineral` (`idmineral`, `nome`, `descricao`, `img`, `idcat`, `sugestao`, `3d`, `idusuario`) VALUES
(2, 'Ouro', '<p>O ouro é um metal de coloração dourada, de aspecto brilhante, resistente à corrosão, dúctil e maleável. Sua beleza fez desse metal um dos mais cobiçados ao longo da história da humanidade, seja por importância econômica, seja por questões religiosas e esotéricas. É considerado o mais nobre dos metais, embora não seja o mais caro nas cotações atuais.</p><p>O ouro é um metal imutável, uma vez que sua inércia química permite que sua aparência permaneça inalterada por milênios, como é o caso do ouro presente na máscara do faraó Tutancâmon, a qual se mantém como se tivesse sido confeccionada pouco tempo atrás. O ouro está amplamente disperso no mundo todo e, por isso, foi descoberto por vários grupos distintos em muitos locais e épocas diferentes, estando atrelado à cultura e história de diversas sociedades. Infelizmente, muitos lutaram e morreram por ele.</p>', 'ouro.png', 1, 0, 'gold.glb', 10),
(3, 'Ametista', '<p class=\"dark\">A ametista é uma variedade de quartzo conhecida por sua cor roxa característica, que varia de tons pálidos a profundos. Sua composição física inclui uma sobreposição irregular de lâminas alternadas de quartzo esquerdo e direito. Esta estrutura pode resultar de estresses mecânicos durante a formação da pedra. Como resultado dessa formação composta, a ametista pode apresentar características como fraturas onduladas, \"impressões digitais\" e até mesmo padrões que lembram um \"motor rodando\" quando há a interseção de dois conjuntos de ondulações curvas em uma superfície fraturada. Alguns mineralogistas, especialmente aqueles que seguem os conceitos de Sir David Brewster, aplicam o termo \"ametista\" a todos os quartzos que exibem essa estrutura, independentemente de sua cor. No entanto, a ametista é mais comumente associada à cor violeta, que é altamente valorizada. Os cristais de ametista geralmente crescem sobre uma base e podem ter formas variadas, incluindo pirâmides. Nas pontas dos cristais, a cor mais intensa tende a predominar. Algumas variedades de ametista podem exibir faixas brancas de quartzo leitoso, enquanto outras podem ter a cor violeta concentrada no centro dos cristais. Inclusões minerais, como aquelas de minerais aciculares, também são comuns na ametista. Uma variedade de inclusões de minerais, como o rutilo, pode ocorrer na ametista, resultando em formações conhecidas como \"Cabeleiras-de-Vênus\". Essas inclusões adicionam interesse estético e valor à pedra.</p>', 'Ametista', 2, 0, 'Ametista-3d.', 4),
(12, 'Ferro', '<p>Batata</p>', 'Ferro', 1, 0, '', 4);

