INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(35, 'ENEM', '<p class=\"ql-align-justify\">Alguém muito recentemente cortara o mato, que na época das chuvas crescia e rodeava a casa da mãe de Ponciá Vicêncio e de Luandi. Havia também vestígios de que a terra fora revolvida, como se ali fosse plantar uma pequena roça. Luandi sorriu. A mãe devia estar bastante forte, pois ainda labutava a terra. Cantou alto uma cantiga que aprendera com o pai, quando eles trabalhavam na terra dos brancos. Era uma canção que os negros mais velhos ensinavam aos mais novos. Eles diziam ser uma cantiga de voltar, que os homens, lá na África, entoavam sempre, quando estavam regressando da pesca, da caça ou de algum lugar. O pai de Luandi, no dia em que queria agradar à mulher, costumava entoar aquela cantiga ao se aproximar de casa. Luandi não entendia as palavras do canto; sabia, porém, que era uma língua que alguns negros falavam ainda, principalmente os velhos. Era uma cantiga alegre. Luandi, além de cantar, acompanhava o ritmo batendo com as palmas das mãos em um atabaque imaginário. Estava de regresso à terra. Voltava em casa. Chegava cantando, dançando a doce e vitoriosa cantiga de regressar.</p><p class=\"ql-align-justify\">EVARISTO, C. Ponciá Vicêncio. Rio de Janeiro: Pallas, 2018.</p>', 'C', 'representa a memória de uma língua africana extinta.', 'exalta a rotina executada por jovens afrodescendentes.', 'preserva a ancestralidade africana por meio da tradição oral.', 'resgata a musicalidade africana por meio de palavras inteligíveis.', '  remonta à tristeza dos negros mais velhos com saudade da África.'),
(36, 'ENEM', '<p>TEXTO I</p><p>Zapeei os canais, como há dezenas de anos faço, e pá: parei num que exibia um episódio daquela velha família do futuro, Os Jetsons.</p><p>Nesse episódio em particular, a Jane Jetson, esposa do George, tratava de dirigir aquele veículo voador deles. Meu queixo foi caindo à medida que as piadinhas machistas sobre mulheres dirigirem foram se acumulando. Impressionante! Que futuro careta aqueles roteiristas imaginavam! Seriam incapazes de projetar algo melhor, e não apenas em termos de tecnologias, robôs e carros voadores? Será que nossa máxima visão de futuro só atinge as coisas, e jamais as pessoas? Como a Jane, uma mulher de 33 anos no desenho, poderia ser o que foram as minhas bisavós?</p><p>O futuro, naquele desenho, se esqueceu de ser melhor nas relações entre as pessoas. Aliás... tão parecido com a vida.</p><p>Fiquei de cara, como dizemos aqui, ou como dizíamos na minha adolescência, pobre adolescência, aprendendo, sem querer e sem muita defesa, um futuro tão besta quanto o passado.</p><p>RIBEIRO, A. E. Disponível em: www.rascunho.com br. Acesso em: 21 out. 2021 (adaptado).</p><p><br></p><p>TEXTO II</p><p>Masculino e feminino são campos escorregadios que só se definem por oposição, sempre incompleta, um do outro. São formações imaginárias que buscam produzir uma diferença radical e complementar onde só existem, de fato, mínimas diferenças. O resto é questão de estilo. Até pelo menos a segunda metade do século 19, o divisor de águas era claro: os homens ocupavam o espaço público. As mulheres tratavam da vida privada. Privada de quê? De visibilidade, diria Hannah Arendt. De visibilidade pública. Do que as mulheres estiveram privadas até o século 20 foi de presença pública manifesta não em imagem, mas em palavra. A palavra feminina, reservada ao espaço doméstico, não produzia diferença na vida social.</p><p>KHEL, M. R. Disponível em: https://alias.estadao.com.br.</p><p>Acesso em: 19 out. 2021 (adaptado).</p><p><br></p><p>A representação da mulher apresentada no Texto I pode ser explicada pelo Texto II no que diz respeito à(às)</p>', 'C', 'censura a formas de expressão femininas.', 'ausência da figura feminina na vida pública.', 'construções imaginárias cristalizadas na sociedade.', 'limitações inerentes às figuras femininas e masculinas.', '  dificuldade na atribuição de papéis masculinos e femininos.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(37, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>Disponível em: www.defensoriapublica.mt.gov.br. Acesso em: 29 out. 2021 (adaptado).</p><p>Esse anúncio publicitário, veiculado durante o contexto</p><p>da pandemia de covid-19, tem por finalidade</p>', 'E', 'divulgar o canal telefônico de atendimento a casos de violência contra a mulher.', 'informar sobre a atuação de uma entidade defensora da mulher vítima de violência', 'evidenciar o trabalho da Defensoria Pública em relação ao problema do abuso contra a mulher.', 'alertar a sociedade sobre o aumento da violência contra a mulher em decorrência do coronavírus.', '  incentivar o público feminino a denunciar crimes de violência contra a mulher durante o período de');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(38, 'ENEM', '<p class=\"ql-align-justify\">Na Idade Média, as notícias se propagavam com surpreendente eficácia. Segundo uma emérita professora de Sorbonne, um cavalo era capaz de percorrer 30 quilômetros por dia, mas o tempo podia se acelerar dependendo do interesse da notícia. As ordens mendicantes tinham um papel importante na disseminação de informações, assim como os jograis, os peregrinos e os vagabundos, porque todos eles percorriam grandes distâncias. As cidades também tinham correios organizados e selos para lacrar mensagens e tentar certificar a veracidade das correspondências. Graças a tudo isso, a circulação de boatos era intensa e politicamente relevante. Um exemplo clássico de fake news da era medieval é a história do rei que desaparece na batalha e reaparece muito depois, idoso e transformado.</p><p class=\"ql-align-justify\">Disponível em: www.elpais.com.br. Acesso em: 18 jun. 2018 (adaptado).</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">A propagação sistemática de informações é um fenômeno recorrente na história e no desenvolvimento das sociedades. No texto, a eficácia dessa propagação está diretamente relacionada ao(à)</p>', 'E', 'velocidade de circulação das notícias.', 'nível de letramento da população marginalizada.', 'poder de censura por parte dos serviços públicos.', 'legitimidade da voz dos representantes da nobreza.', 'diversidade dos meios disponíveis em uma época histórica.'),
(39, 'ENEM', '<p>Se a interferência de contas falsas em discussões políticas nas redes sociais já representava um perigo para os sistemas democráticos, sua sofisticação e maior semelhança com pessoas reais têm agravado o problema pelo mundo.</p><p>O perigo cresceu porque a tecnologia e os métodos evoluíram dos robôs, os “bots” — softwares com tarefas on-line automatizadas —, para os “ciborgues” ou “trolls”, contas controladas diretamente por humanos com ajuda de um pouco de automação.</p><p>Mas pesquisadores começam agora a observar outros padrões de comportamento: quando mensagens não são programadas, sua publicação se concentra só em horários de trabalho, já que é controlada por pessoas cuja profissão é exatamente essa, administrar um perfil falso durante o dia.</p><p>Outra pista: a pobreza vocabular das mensagens publicadas por esses perfis. Um funcionário de uma empresa que supostamente produzia e vendia perfis falsos explica que às vezes “faltava criatividade” para criar mensagens distintas controlando tantos perfis falsos ao mesmo tempo.</p><p>GRAGNANI, J. Disponível em: www.bbc.com. Acesso em: 16 dez. 2017.</p><p><br></p><p>De acordo com o texto, a análise de características da linguagem empregada por perfis automatizados contribui para o(a)</p>', 'E', 'controle da atuação dos profissionais de TI.', 'desenvolvimento de tecnologias como os “trolls”.', 'flexibilização dos turnos de trabalho dos controladores.', 'necessidade de regulamentação do funcionamento dos “bots”.', 'identificação de padrões de disseminação de informações inverídicas.'),
(40, 'ENEM', '<p>Maio foi colorido de amarelo, e o foi porque mundialmente amarelo é a cor convencionada para as advertências. No trânsito, essas advertências têm sido fatais. A estimativa, caso nada seja feito, é a de que se atinjam assustadoras 2,4 milhões de mortes no trânsito em 2030 em todo o mundo.</p><p>A pressa constante, o sentimento de invencibilidade, a certeza de invulnerabilidade, a necessidade de poder, a falta de civilidade, a certeza de impunidade, a ausência de solidariedade, a inexistência de compaixão e o desrespeito por si próprio são circunstâncias reais que, não raro, concorrem para o comportamento violento no trânsito.</p><p>O Maio Amarelo, que preconiza a atenção pela vida, é uma das iniciativas nesse sentido. E é precisamente a atenção pela vida que está esquecida. Essa atenção, por certo, requer menos pressa, mais civilidade, limites assegurados, consciência de vulnerabilidade, solidariedade, compaixão e respeito por si e pelo outro. Reafirmar e praticar esses princípios e valores talvez seja um caminho mais seguro e menos violento, que garanta a vida e não celebre a morte.</p><p>Disponível em: http://portaldotransito.com.br. Acesso em: 11 dez. 2018 (adaptado).</p><p><br></p><p>Considerando	os	procedimentos	argumentativos</p><p>utilizados, infere-se que o objetivo desse texto é</p>', 'D', 'enumerar as causas determinantes da violência no trânsito.', 'contextualizar a campanha de advertência no cenário mundial.', 'divulgar dados numéricos alarmantes sobre acidentes de trânsito.', 'sensibilizar o público para a importância de uma direção responsável.', 'restringir os problemas da violência no trânsito a aspectos emocionais.'),
(41, 'ENEM', '<p>Era um gato preto, como convinha a um cultor das boas letras, que já lera Poe traduzido por Baudelaire. Preto e gordo. E lerdo. Tão gordo e lerdo que a certa altura observei que ia perdendo inteiramente as qualidades características da raça, que são em suma o ódio de morte aos ratos. Já nem os afugentava! Os ratos de Ouro Preto são também dignos e solenes — não ria — tradicionalistas... descendentes de outros ratos que naqueles mesmos casarões presenciaram acontecimentos importantes da nossa história... No sobrado do desembargador Tomás Antônio Gonzaga, imagine o senhor uma reunião dos sonhadores inconfidentes, com os antepassados daqueles ratos a passearem pelo sótão ou mesmo pelo assoalho por entre as pernas dos homens absortos na esperança da independência nacional! E depois, os ancestres daqueles roedores que eu via agora deslizar sutilmente no meu quarto podiam ter subido pelo poste da ignomínia colonial, onde estava exposta a cabeça do Tiradentes! E quando as órbitas se descarnaram ignominiosamente, podiam até ter penetrado no recesso daquele crânio onde verdadeiramente ardera a literatura, com a simplicidade do heroísmo, a febre nacionalista...</p><p>ALPHONSUS, J. Contos e novelas. Rio de Janeiro: Imago; Brasília: INL, 1976.</p><p><br></p><p>Descrevendo seu gato, o narrador remete ao contexto e a protagonistas da Inconfidência para criar um efeito desconcertante centrado no</p>', 'E', 'desenho imaginativo do casario colonial de Ouro Preto.', 'efeito de apagamento de limites entre ficção e realidade.', 'vínculo estabelecido entre animais urbanos e literatura.', 'questionamento sutil quanto à sanidade dos inconfidentes.', 'contraste entre austeridade pomposa e imagem repugnante.'),
(42, 'ENEM', '<p>Enquanto estivemos entretidos com os urubus outras coisas andaram acontecendo na cidade. A Companhia baixou novas proibições, umas inteiramente bobocas, só pelo prazer de proibir (ninguém podia cuspir pra cima, nem carregar água em jacá, nem tapar o sol com peneira, como se todo mundo estivesse abusando dessas esquisitices); mas outras bem irritantes, como a de pular muro pra cortar caminho, tática que quase todo mundo que não sofria de reumatismo vinha adotando ultimamente, principalmente os meninos. E não confiando na proibição só, nem na força dos castigos, que eram rigorosos, a Companhia ainda mandou fincar cacos de garrafa nos muros. Achei isso um exagero, e comentei o assunto com mamãe. Meu pai ouviu lá do quarto e veio explicar. Disse que em épocas normais bastava uma coisa ou outra; mas agora a Companhia não podia admitir nenhuma brecha em suas ordens; se alguém desobedecesse à proibição podia se cortar nos cacos; se alguém conseguisse pular um muro quebrando o corte de alguns cacos, ou jogando um couro por cima, era apanhado pela proibição, nhoc — e fez o gesto de quem torce o pescoço de um frango.</p><p><br></p><p>Sob a perspectiva do menino que narra, os fatos ficcionais oferecem um esboço do momento político vigente na década de 1970, aqui representado pelo</p>', 'A', ' culto ao medo, infiltrado em situações do cotidiano.', 'sentimento de dúvida quanto à veracidade das informações.', 'ambiente de sonho, delineado por imagens perturbadoras.', 'incentivo ao desenvolvimento econômico com a iniciativa privada.', 'espaço urbano marcado por uma política de isolamento das crianças.'),
(43, 'ENEM', '<p>Migalhas</p><p>Entre a toalha branca e um bule de café seria inapropriado dizer</p><p>eu não te amo mais.</p><p>Era necessário algo mais solene, um jardim japonês</p><p>para as perdas pensadas, um noturno de tempestade para arrebentar de dor,</p><p>uma praia de pedras para chorar em silêncio, uma cama alta</p><p>para o incenso da despedida, uma janela</p><p>dando para o abismo.</p><p>No entanto você abaixa os olhos</p><p>e recolhe lentamente as migalhas de pão sobre a mesa posta para dois.</p><p>MARQUES, A. M. A vida submarina. São Paulo: Cia. das Letras, 2021.</p><p><br></p><p>Nesse poema, a representação do sentimento amoroso recupera a tradição lírica, mas se ajusta à visão contemporânea ao</p><p><br></p>', 'C', 'invocar o interlocutor para uma tomada de posição.', 'questionar a validade do envolvimento romântico.', 'diluir em banalidade a comoção de um amor frustrado.', 'transformar em paz as emoções conflituosas do casal.', ' condicionar a existência da paixão a espaços idealizados.'),
(44, 'ENEM', '<p>Passado muito tempo, resolvi tentar falar, porque estava sozinha me embrenhando na mesma vereda que Donana costumava entrar. Ainda recordo da palavra que escolhi: arado. Me deleitava vendo meu pai conduzindo o arado velho da fazenda carregado pelo boi, rasgando a terra para depois lançar grãos de arroz em torrões marrons e vermelhos revolvidos. Gostava do som redondo, fácil e ruidoso que tinha ao ser enunciado. “Vou trabalhar no arado.” “Vou arar a terra.” “Seria bom ter um arado novo, esse arado tá troncho e velho.” O som que deixou minha boca era uma aberração, uma desordem, como se no lugar do pedaço perdido da língua tivesse um ovo quente. Era um arado torto, deformado, que penetrava a terra de tal forma a deixá-la infértil, destruída, dilacerada.</p><p>VIEIRA JR., I. Torto arado. São Paulo: Todavia, 2019.</p><p>Com a perda de parte da língua na infância, a narradora tenta voltar a falar. Essa tentativa revela uma experiência que</p><p><br></p>', 'B', 'reflete o olhar do pai sobre as etapas do plantio.', 'metaforiza a linguagem como ferramenta de lavoura.', 'explicita, na busca pela palavra, o medo da solidão.', 'confirma a frustração da narradora com relação à terra.', ' sugere, na ausência da linguagem, a estagnação do tempo.'),
(45, 'ENEM', '<p>A escravidão</p><p>Esses meninos que aí andam jogando peteca não viram nunca um escravo... Quando crescerem, saberão que já houve no Brasil uma raça triste, votada à escravidão e ao desespero; e verão nos museus a coleção hedionda dos troncos, dos vira-mundos e dos bacalhaus; e terão notícias dos trágicos horrores de uma época maldita: filhos arrancados ao seio das mães, virgens violadas em pranto, homens assados lentamente em fornos de cal, mulheres nuas recebendo na sua mísera nudez desvalida o duplo ultraje das chicotadas e dos olhares do feitor bestial. [...]</p><p>Mas a sua indignação nunca poderá ser tão grande como a daqueles que nasceram e cresceram em pleno horror, no meio desse horrível drama de sangue e lodo, sentindo dentro do ouvido e da alma, numa arrastada e contínua melopeia, o longo gemer da raça mártir — orquestração satânica de todos os soluços, de todas as impressões, de todos os lamentos que a tortura e a injustiça podem arrancar a gargantas humanas.</p><p>BILAC, O. Disponível em: www.escritas.org. Acesso em: 29 out. 2021.</p><p>Publicado em 1902, o texto de Olavo Bilac enfatiza as mazelas da escravidão no Brasil ao</p>', 'C', ' descrever de modo impessoal as consequências da exploração racial sobre as gerações futuras.', 'contrapor a infância privilegiada das crianças da época à infância violentada das crianças escravizadas.', 'antecipar o futuro apagamento das marcas da escravidão no contexto social.', 'criticar a atenuação da violência contra os povos escravizados nas memórias retratadas pelos museus.', ' imaginar a reação de indiferença de seus contemporâneos com os escravizados libertos.'),
(46, 'ENEM', '<p>E assim as coisas continuaram acontecendo entre os dois, em quase sustos, um grande por acaso com cacoetes de gestos definitivos. Com o Nunca Mais se oferecendo o tempo todo, bastaria dizer foi um prazer ter te conhecido, bastaria não trocar telefones nem e-mails e enterrar a casualidade com a cal da sabedoria — nada poderia ser definitivo, os encontros duravam duas horas ou duas décadas ou duas vezes isso, mas em algum momento necessariamente seria o fim. De todos os grandes amores. De todos os pequenos. De todas as juras, das promessas, de todos os na-alegria-e-na-tristeza. De todos os não amores, os desamores, os casamentos para sempre, os rancores para sempre, de todas as paralelas que só se viabilizam na abstração da geometria, de todas as pequenas paixões e de todas as grandes paixões, de tudo que para na antessala da paixão, de todos os vínculos não experimentados, de todos.</p><p>LISBOA, A. Rakushisha. Rio de Janeiro: Objetiva, 2014.</p><p><br></p><p>O recurso que promove a progressão textual, contribuindo para a construção da ideia de que as relações amorosas têm um enredo comum, é a</p><p><br></p>', 'A', 'repetição do pronome indefinido “todos”.', 'utilização do travessão na marcação do aposto.', 'retomada do antecedente pelo pronome “isso”.', 'contraposição de ideias marcada pela conjunção “mas”.', 'substantivação de expressões pela anteposição do artigo.'),
(47, 'ENEM', '<p>A garganta é a gruta que guarda o som</p><p>A garganta está entre a mente e o coração Vem coisa de cima, vem coisa de baixo e de</p><p>[repente um nó (e o que eu quero dizer?) Às vezes, acontece um negócio esquisito</p><p>Quando eu quero falar eu grito, quando eu quero [gritar eu falo, o resultado</p><p>Calo.</p><p>ESTRELA D’ALVA, R. Disponível em: https://claudia.abril.com.br.</p><p>Acesso em: 23 nov. 2021 (fragmento).</p><p><br></p><p>A função emotiva presente no poema cumpre o propósito do eu lírico de</p>', 'C', 'revelar as desilusões amorosas.', 'refletir sobre a censura à sua voz.', 'expressar a dificuldade de comunicação.', 'ressaltar a existência de pressões externas.', 'manifestar as dores do processo de criação.'),
(48, 'ENEM', '<p>O sol começa a descer por trás da vegetação da Ilha da Restinga, na outra margem do rio Paraíba, colorindo o céu de amarelo, laranja e lilás. Então se ouvem as primeiras notas do Bolero, do compositor francês Maurice Ravel, executadas pelo saxofonista Jurandy. É assim o pôr do sol da praia do Jacaré, em Cabedelo (Grande João Pessoa). Depois do Bolero, Jurandy toca Asa branca, de Luiz Gonzaga, e Meu sublime torrão, de Genival Macedo, espécie de hino não oficial da Paraíba.</p><p>PINHEIRO, A. Sol se põe embalado pelo Bolero de Ravel. Disponível em:</p><p>http://tools.folha.com.br. Acesso em: 16 set. 2012 (adaptado).</p><p><br></p><p>A interpretação musical de Jurandy do Sax, codinome de José Jurandy Félix, apresenta um repertório caracterizado pela</p>', 'A', ' inter-relação de referenciais estéticos aparentemente distanciados.', 'valorização de músicas que revelam mensagens de serenidade.', 'consagração do repertório erudito como cultura dominante.', 'iniciativa de estímulo à vocação turística da cidade.', ' divisão hierárquica entre gêneros e estilos musicais.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(49, 'ENEM', '<p>TEXTO I</p><p><img src=\"data:image/png;base64,\"></p><p>SEGALL, L. Eternos caminhantes. Óleo sobre tela, 138 x 184 cm.</p><p>Museu Lasar Segall, IbramMinc, São Paulo, 1919.</p><p>TEXTO II</p><p>Em 1933, a obra Eternos caminhantes ingressou em uma das primeiras edições das exposições de Arte Degenerada, promovida por membros do partido nazista alemão. Nos anos seguintes, ela voltaria a ser exibida na mostra denominada Exposição da Vergonha, promovida por pequenos grupos abastados. Em 1937, essa obra foi confiscada pelo Ministério da Propaganda daquele país, na grande ação nacional-socialista contra a “Arte Degenerada”.</p><p>SCHWARTZ, J. Perseguição à Arte Moderna em tempos de guerra. São Paulo: Museu Lasar Segall, 2018 (adaptado).</p><p><br></p><p>Quase cinquenta obras de Lasar Segall foram confiscadas pelo regime totalitário alemão na primeira metade do século XX, entre elas a obra Eternos caminhantes, considerada degenerada por</p>', 'A', 'representar uma estética tida como inconveniente para o ideário político vigente.', 'manifestar  um  posicionamento  político-cultural concebido por grupos de oposição.', 'expressar a cultura artística por meio da representação parcial do corpo humano.', 'apresentar uma composição que antecipa o imaginário artístico germânico.', 'estimular discussões sobre o papel da arte na construção coletiva de cultura.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(50, 'ENEM', '<p>TEXTO I</p><p>Logo no início de Gira, um grupo de sete bailarinas ocupa o centro da cena. Mãos cruzadas sobre a lateral esquerda do quadril, olhos fechados, troncos que pendulam sobre si mesmos em vaguíssimas órbitas, tudo nelas sugere o transe. Está estabelecido o caráter volátil do que se passará no palco dali para frente. Mas engana-se quem pensa que vai assistir a uma representação mimética dos cultos afro-brasileiros.</p><p>TEXTO II</p><p><img src=\"data:image/png;base64,\"></p><p>Disponível em: www.grupocorpo.com.br. Acesso em: 2 jul. 2019.</p><p><br></p><p>No diálogo que estabelece com religiões afro-brasileiras, sintetizado na descrição e na imagem do espetáculo, a dança exprime uma</p>', 'C', 'crítica aos movimentos padronizados do balé clássico.', 'representação contemporânea de rituais ancestrais extintos.', 'reelaboração estética erudita de práticas religiosas populares.', 'releitura irônica da atmosfera mística presente no culto a entidades.', 'oposição entre o resgate de tradições e a efemeridade da vida humana.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(51, 'ENEM', '<p>A indústria do esporte eletrônico é um mercado que está crescendo em um ritmo mais rápido do que a economia mundial. Sua popularidade cresceu muito e no Brasil não é diferente. De acordo com os dados de uma pesquisa, mais de 64% dos brasileiros que jogam videogame já ouviram falar de esporte eletrônico. No entanto, o que chama a atenção é o crescimento superior a 10% do público praticante comparado ao ano anterior, que subiu de 44,7% para 55,4%. Trata-se de um percentual expressivo, já que o Brasil está no top 3 dentre os países que têm maior número de espectadores de esporte eletrônico do mundo. Comparado ao ano anterior, em 2020, o Brasil teve um marco de crescimento de 20% na audiência. Mundo afora, a árdua dedicação de grandes gamers contribuiu para o reconhecimento do Comitê Olímpico Internacional, aliado a outras cinco federações esportivas e suas desenvolvedoras de jogos, que direcionaram um olhar mais atento ao assunto, permitindo dar o primeiro passo para concretizar, pela primeira vez na história dos jogos eletrônicos, um evento olímpico oficial.</p><p>Disponível em: https://chicoterra.com. Acesso em: 19 nov. 2021 (adaptado).</p><p><br></p><p>O contexto em que o esporte eletrônico é apresentado no texto demonstra o(a)</p>', 'A', 'condição favorável à expansão dessa modalidade.', 'promoção dessa prática por jogadores profissionais.', 'impulsionamento de um processo de marketing.', 'favorecimento de fabricantes dos jogos.', ' modificação da audiência televisiva.'),
(52, 'ENEM', '<p>O Marabaixo é uma expressão artístico-cultural formada nas tradições e na identificação cultural entre as comunidades negras do Amapá. O nome remonta às mortes de escravizados em navios negreiros que eram jogados na água. Em sua homenagem, hinos de lamento eram cantados mar abaixo, mar acima. Posteriormente, o Marabaixo se integrou à vivência das comunidades negras em um ciclo de danças, cantorias com tambores e festas religiosas, recebendo, em 2018, o título de Patrimônio Cultural do Brasil.</p><p>Disponível em: http://portal.iphan.gov.br. Acesso em: 15 nov. 2021 (adaptado).</p><p><br></p><p>A manifestação do Marabaixo se constituiu em expressão de arte e cultura, exercendo função de</p>', 'A', 'ressignificar episódios dramáticos em novas práticas culturais.', 'adaptar coreografias como imitação dos movimentos do mar.', 'lembrar dos mortos no passado escravista como forma de lamento.', 'perpetuar uma narrativa de apagamento dos fatos históricos traumáticos.', ' ritualizar a passagem de atos fúnebres nas produções coletivas com espírito festivo.'),
(53, 'ENEM', '<p>O uso das redes sociais como forma de ampliar universos foi uma descoberta recente para o artista Wolney Fernandes, que começou a criar quando o ambiente em Goiás era mais árido em relação às artes visuais. “Hoje, ser diferente é uma potência e quem sabe o que quer com a própria arte encontra espaço”, diz. As colagens artísticas do goiano aparecem em capas de obras literárias pelo Brasil e exterior.</p><p>Disponível em: https://opopular.com.br. Acesso em: 15 nov. 2021 (adaptado).</p><p><br></p><p>O artista goiano Wolney Fernandes busca expor seu</p><p>trabalho por meio de plataformas virtuais com o objetivo de</p>', 'C', 'dar suporte à técnica de colagem em Artes Visuais, contornando dificuldades práticas.', 'aproximar-se da estética visual própria da editoração de obras artísticas, como capas de livros.', 'oferecer uma vitrine internacional para sua produção artística, a fim de dar mais visibilidade a suas obras.', 'enfatizar o caráter original e inovador de suas criações artísticas, diferenciando-se das artes tradicionais.', 'trazer um sentido tecnológico às suas colagens, uma vez que as imagens artísticas são recorrentes nas redes sociais.'),
(54, 'ENEM', '<p>O mais antigo grupo de rap indígena do país, Brô MCs, surgiu em 2009, na aldeia Jaguapiru, em Dourados, Mato Grosso do Sul. Os integrantes conheceram o rap pelo rádio, ouvindo um programa que apresentava cantores e grupos brasileiros desse gênero musical. O Brô MCs conseguiu influenciar outros a fazerem rap e a lutarem pelas causas indígenas. Um dos nomes do movimento, Kunumí MC, é um jovem de 16 anos, da aldeia Krukutu, em São Paulo. O adolescente enxerga o rap como uma cultura da defesa e começou a fazer rimas quando percebeu que a poesia, pela qual sempre se interessou, podia virar música. Nas letras que cria, inspiradas tanto pelo rap quanto pelos ritmos indígenas, tenta incluir sempre assuntos aos quais acha importante dar voz, principalmente, a questão da demarcação de terras.</p><p>Disponível em: www.correiobraziliense.com.br. Acesso em: 13 nov. 2021 (adaptado).</p><p>O movimento rap dos povos originários do Brasil revela o(a) </p>', 'A', ' fusão  de  manifestações  artísticas  urbanas contemporâneas com a cultura indígena.', 'contraposição das temáticas socioambientais indígenas às questões urbanas.', 'rejeição da indústria radiofônica às músicas indígenas.', 'distanciamento da realidade social indígena.', 'estímulo ao estudo da poesia indígena.'),
(55, 'ENEM', '<p>Mestre e companheiro, disse eu que nos íamos despedir. Mas disse mal. A morte não extingue: transforma; não aniquila: renova; não divorcia: aproxima. Um dia supuseste “morta e separada” a consorte dos teus sonhos e das tuas agonias, que te soubera “pôr um mundo inteiro no recanto” do teu ninho; e, todavia, nunca ela te esteve mais presente, no íntimo de ti mesmo e na expressão do teu canto, no fundo do teu ser e na face de tuas ações. Esses catorze versos inimitáveis, em que o enlevo dos teus discípulos resume o valor de toda uma literatura, eram a aliança de ouro do teu segundo noivado, um anel de outras núpcias, para a vida nova do teu renascimento e da tua glorificação, com a sócia sem nódoa dos teus anos de mocidade e madureza, da florescência e frutificação de tua alma. Para os eleitos do mundo das ideias a miséria está na decadência, e não na morte. A nobreza de uma nos preserva das ruínas da outra. Quando eles atravessavam essa passagem do invisível, que os conduz à região da verdade sem mescla, então é que entramos a sentir o começo do seu reino, o reino dos mortos sobre os vivos.</p><p>BARBOSA, R. O adeus da Academia a Machado de Assis. Rio de Janeiro: Agir, 1962.</p><p>Esse é um trecho do discurso de Rui Barbosa na Academia Brasileira de Letras em homenagem a Machado de Assis por ocasião de sua morte. Uma das características desse discurso de homenagem é a presença de</p>', 'A', 'metáforas relacionadas à trajetória pessoal e criadora do homenageado.', 'recursos fonológicos empregados para a valorização do ritmo do texto.', 'frases curtas e diretas no relato da vida e da morte do homenageado.', 'contraposição de ideias presentes na obra do homenageado.', ' seleção vocabular representativa do sentimento de nostalgia.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(56, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>Disponível em: www.facebook.com/minsaude. Acesso em: 13 jun. 2018.</p><p><br></p><p>Essa campanha publicitária do Ministério da Saúde visa</p>', 'A', 'divulgar um conjunto de benefícios proporcionados pela amamentação.', 'apresentar tratamentos para infecções respiratórias em bebês.', 'defender o direito das mulheres de amamentar em público.', 'orientar sobre os exercícios para uma boa amamentação.', ' informar sobre o aumento de anticorpos nas mães.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(57, 'ENEM', '<p>Carta aberta à população brasileira</p><p>Prezados Cidadãos e Cidadãs,</p><p>O envelhecimento populacional é um fenômeno mundial. Infelizmente, nosso país ainda não está preparado para atender às demandas dessa população.</p><p>Este é o retrato da saúde pública no Brasil, que, apesar dos indiscutíveis avanços, apresenta um cenário de deficiências e falta de integração em todos os níveis de atenção à saúde: primária (atendimento deficiente nas unidades de saúde da atenção básica), secundária (carência de centros de referência com atendimento por especialistas) e terciária (atendimento hospitalar com abordagem ao idoso centrada na doença), ou seja, não há, na prática, uma rede de atenção à saúde do idoso.</p><p>Diante desse cenário, a Sociedade Brasileira de Geriatria e Gerontologia (SBGG) vem a público manifestar suas preocupações com o presente e o futuro dos idosos no Brasil. É preciso garantir a saúde como direito universal.</p><p>Esperamos que tanto nossos atuais quanto os futuros governantes e legisladores reflitam sobre a necessidade de investir na saúde e na qualidade de vida associada ao envelhecimento.</p><p>Dignidade à saúde do idoso!</p><p>Rio de Janeiro, 15 de setembro de 2014.</p><p>Disponível em: www.sbgg.org.br. Acesso em: 20 out. 2021 (adaptado).</p><p><br></p><p>O objetivo desse texto é</p>', 'E', 'sensibilizar o idoso a respeito dos cuidados com a saúde.', 'alertar os governantes sobre os cuidados requeridos pelo idoso.', 'divulgar o trabalho da Sociedade Brasileira de Geriatria e Gerontologia.', 'informar o setor público sobre o retrocesso da legislação destinada à população idosa.', ' chamar a atenção da população sobre a qualidade dos serviços de saúde pública para o idoso.'),
(58, 'ENEM', '<p>A petição on-line criada por um cidadão paulista surtiu efeito: casado há três anos com seu companheiro, ele pedia a alteração da definição de “casamento” no tradicional dicionário Michaelis em português. Na definição anterior, casamento aparecia como “união legítima entre homem e mulher” e “união legal entre homem e mulher, para constituir família”.</p><p>O novo verbete não traz em nenhum momento as palavras homem ou mulher — agora a definição de casamento se refere a “pessoas”.</p><p>Para o diretor de comunicação do site onde a petição foi publicada, a iniciativa mostra a “eficiência da mobilização”. “Em dois dias, mudou-se uma definição que permanecia a mesma há décadas”, afirma. E conclui: “A plataforma serve para todos os tipos de causas, para as mudanças que importam para as pessoas.”.</p><p>SENRA, R. Disponível em: www.bbc.com. Acesso em: 29 out. 2015.</p><p>A notícia trata da mudança ocorrida em um dicionário da língua portuguesa. Segundo o texto, essa mudança foi impulsionada pela</p><p><br></p>', 'C', 'inclusão de informações no verbete.', 'relevância social da instituição casamento.', 'utilização pública da petição pelos cidadãos.', 'rapidez na disseminação digital do verbete.', ' divulgação de plataformas para a criação de petição.'),
(59, 'ENEM', '<p>A neozelandesa Laurel Hubbard fez história nos Jogos Olímpicos. Apesar de ter ficado de fora da disputa por medalhas, a levantadora de peso deixou sua marca na edição de Tóquio por ser a primeira mulher abertamente transgênero a participar de uma competição olímpica. No início da carreira, na década de 1990, a neozelandesa participava de disputas na categoria masculina. Em 2001, aos 23 anos, ela se afastou da atividade. “A pressão de tentar me encaixar em um mundo que talvez não tenha sido feito para pessoas como eu se tornou um fardo muito grande para suportar.” Em 2012, Laurel começou sua transição de gênero por meio de terapias hormonais e, em 2013, declarou abertamente ser uma mulher trans. Para o Comitê Olímpico Internacional, a participação de mulheres trans nos Jogos é permitida caso o nível de testosterona, hormônio que aumenta a massa muscular, esteja abaixo de 10 nanomols por litro por pelo menos 12 meses.</p><p>Disponível em: https://revistagalileu.globo.com. Acesso em: 18 nov. 2021 (adaptado).</p><p>No texto, os limites do potencial inclusivo do esporte são dados pela</p>', 'B', 'dificuldade de conseguir bons resultados esportivos.', 'dependência de características biológicas padronizadas.', 'inexistência de uma categoria para pessoas transgênero.', 'necessidade de afastamento temporário das competições.', ' impossibilidade de uso controlado de substâncias exógenas.'),
(60, 'ENEM', '<p>“Ganhei 25 medalhas em mundiais, sete em Jogos Olímpicos, e sou uma sobrevivente de abuso sexual.” Foi assim que Simone Biles se apresentou ao comitê do Senado norte-americano que investiga as supostas falhas do FBI no caso Larry Nassar. Biles e outras três atletas, vítimas dos abusos do ex-médico da equipe de ginástica feminina dos EUA, exigiram que os agentes da investigação sejam processados por falta de ação prévia contra Nassar, agora preso. Biles esclareceu que culpa Larry Nassar e “todo o sistema que o permitiu e o perpetrou”, acusando a Federação de Ginástica e o Comitê Olímpico dos Estados Unidos de saberem “muito antes” que ela havia sofrido abusos. A melhor ginasta do mundo é um ícone. Nos Jogos Olímpicos de Tóquio, uma lesão psicológica a impediu de competir como previa. No entanto, ela chegou ao topo como uma líder no trabalho de acabar com o preconceito com os problemas de saúde mental. “Não quero que nenhum outro atleta olímpico sofra o horror que eu e outras centenas suportamos e continuamos suportando até hoje”, afirmou.</p><p>Disponível em: https://brasil.elpais.com. Acesso em: 31 out. 2021 (adaptado).</p><p>O fato relatado na notícia chama a atenção acerca da</p><p>necessidade de reflexão sobre a relação entre o esporte e</p>', 'B', 'o desempenho atlético internacional.', 'a dimensão emocional dos atletas.', 'os comitês olímpicos nacionais.', 'as instituições de inteligência.', 'as federações esportivas.'),
(61, 'ENEM', '<p>O acesso às Práticas Corporais/Atividades Físicas (PC/AF) é desigual no Brasil, à semelhança de outros indicadores sociais e de saúde. Em geral, PC/AF prazerosas, diversificadas, mais afeitas ao período de lazer estão concentradas nas populações mais abastadas. As atividades físicas de deslocamento, trajetos a pé ou de bicicleta para estudar ou trabalhar, por exemplo, são mais frequentes na classe social menos favorecida. Aqui, há uma relação inversa e perversa entre variáveis socioeconômicas de acesso às PC/AF. As maiores prevalências de inatividade física foram em mulheres, pessoas com 60 anos ou mais, negros, pessoas com autoavaliação de saúde ruim ou muito ruim, com renda familiar de até quatro salários mínimos por pessoa, pessoas que desconhecem programas públicos de PC/AF e residentes em áreas sem locais públicos para a prática.</p><p>KNUTH, A. G.; ANTUNES, P. C. Saúde e Sociedade, n. 2, 2021 (adaptado).</p><p>O fator central que impacta a realização de práticas corporais/atividades físicas no tempo de lazer no Brasil é a </p>', 'E', 'diferença entre homens e mulheres.', 'inexistência de políticas públicas.', 'diversidade de faixa etária.', 'variação de condição étnica.', 'desigualdade entre classes sociais.'),
(62, 'ENEM', '<p>Dão Lalalão</p><p>Do povoado do Ão, ou dos sítios perto, alguém precisava urgente de querer vir por escutar a novela do rádio. Ouvia-a, aprendia-a, guardava na ideia, e, retornado ao Ão, no dia seguinte, a repetia a outros.</p><p>Assim estavam jantando, vinham os do povoado receber a nova parte da novela do rádio. Ouvir já tinham ouvido tudo, de uma vez, fugia da regra: falhara ali no Ão, na véspera, o caminhão de um comprador de galinhas e ovos, seo Abrãozinho Buristém, que carregava um rádio pequeno, de pilhas, armara um fio no arame da cerca... Mas queriam escutar outra vez, por confirmação. — “A estória é estável de boa, mal que acompridada: taca e não rende...” — explicava o Zuz ao Dalberto.</p><p>Soropita começou a recontar o capítulo da novela. Sem trabalho, se recordava das palavras, até com clareza — disso se admirava. Contava com prazer de demorar, encher a sala com o poder de outros altos personagens. Tomar a atenção de todos, pudesse contar aquilo noite adiante. Era preciso trazer luz, nem uns enxergavam mais os outros; quando alguém ria, ria de muito longe. O capítulo da novela estava terminando.</p><p>ROSA, J. G. Noites do sertão (Corpo de baile). São Paulo: Global, 2021.</p><p><br></p><p>Nesse trecho do conto, o gosto dos moradores do povoado por ouvir a novela de rádio recontada por Soropita deve-se ao(à)</p>', 'D', 'qualidade do som do rádio.', 'estabilidade do enredo contado.', 'ineditismo do capítulo da novela.', 'jeito singular de falar aos ouvintes.', 'dificuldade de compreensão da história.'),
(63, 'ENEM', '<p>As cinzas do Museu Nacional, no Rio de Janeiro, consumido pelas chamas no mês de setembro de 2018, são mais do que restos de fósseis, cerâmicas e espécimes raros. O museu abrigava, entre mais de 20 milhões de peças, os esqueletos com as respostas para perguntas que ainda não haviam sido respondidas — ou sequer feitas — por pesquisadores brasileiros. E o incêndio pode ter calado para sempre palavras e cantos indígenas ancestrais, de línguas que não existem mais no mundo.</p><p>O acervo do local continha gravações de conversas, cantos e rituais de dezenas de sociedades indígenas, muitas feitas durante a década de 1960 com antigos gravadores de rolo e que ainda não haviam sido digitalizadas. Alguns dos registros abordavam línguas já extintas, sem falantes originais ainda vivos. “A esperança é que outras instituições tenham registros dessas línguas”, diz a linguista Marilia Facó Soares. A pesquisadora, que trabalha com os índios Tikuna, o maior grupo da Amazônia brasileira, crê ter perdido parte de seu material. “Terei que fazer novas viagens de campo para recompor meus arquivos. Mas obviamente não dá para recuperar a fala de nativos já falecidos, geralmente os mais idosos”, lamenta.</p><p>Disponível em: https://brasil.elpais.com. Acesso em: 10 dez. 2018 (adaptado).</p><p><br></p><p>A perda dos registros linguísticos no incêndio do Museu Nacional tem impacto potencializado, uma vez que</p>', 'B', 'exige a retomada das pesquisas por especialistas de diferentes áreas.', 'representa danos irreparáveis à memória e à identidade nacionais.', 'impossibilita o surgimento de novas pesquisas na área.', 'resulta na extinção da cultura de povos originários.', 'inviabiliza o estudo da língua do povo Tikuna.'),
(64, 'ENEM', '<p>Ainda daquela vez pude constatar a bizarrice dos costumes que constituíam as leis mais ou menos constantes do seu mundo: ao me aproximar, verifiquei que o Sr. Timóteo, gordo e suado, trajava um vestido de franjas e lantejoulas que pertencera a sua mãe. O corpete descia-lhe excessivamente justo na cintura, e aqui e ali rebentava através da costura um pouco da carne aprisionada, esgarçando a fazenda e tornando o prazer de vestir-se daquele modo uma autêntica espécie de suplício. Movia-se ele com lentidão, meneando todas as suas franjas e abanando-se vigorosamente com um desses leques de madeira de sândalo, o que o envolvia numa enjoativa onda de perfume. Não sei direito o que colocara sobre a cabeça, assemelhava-se mais a um turbante ou a um chapéu sem abas de onde saíam vigorosas mechas de cabelos alourados. Como era costume seu também, trazia o rosto pintado — e para isto, bem como para suas vestimentas, apoderara-se de todo o guarda-roupa deixado por sua mãe, também em sua época famosa pela extravagância com que se vestia — o que sem dúvida fazia sobressair-lhe o nariz enorme, tão característico da família Meneses.</p><p>CARDOSO, L. Crônica da casa assassinada. São Paulo: Círculo do Livro, s.d.</p><p><br></p><p>Pela voz de uma empregada da casa, a descrição de um dos membros da família exemplifica a renovação da ficção urbana nos anos 1950, aqui observada na</p>', 'C', 'opção por termos e expressões de sentido ambíguo.', 'crítica social inspirada pelo convívio com os patrões.', 'descrição impressionista do fetiche do personagem.', 'presença de um foco narrativo de caráter impreciso.', 'ambiência de mistério das relações entre familiares.'),
(65, 'ENEM', '<p>Girassol da madrugada</p><p>Teu dedo curioso me segue lento no rosto</p><p>Os sulcos, as sombras machucadas por onde a [vida passou.</p><p>Que silêncio, prenda minha... Que desvio triunfal [da verdade,</p><p>Que círculos vagarosos na lagoa em que uma asa [gratuita roçou...</p><p><br></p><p>Tive quatro amores eternos... O primeiro era moça donzela,</p><p>O segundo... eclipse, boi que fala, cataclisma, O terceiro era a rica senhora,</p><p>O quarto és tu... E eu afinal me repousei dos</p><p>[meus cuidados</p><p>ANDRADE, M. Poesias completas. Rio de Janeiro: Nova Fronteira, 2013 (fragmento).</p><p><br></p><p>Perante o outro, o eu lírico revela, na força das memórias evocadas, a</p><p><br></p>', 'C', 'vergonha das marcas provocadas pela passagem do tempo.', 'indecisão em face das possibilidades afetivas do presente.', 'serenidade sedimentada pela entrega pacífica ao desejo.', 'frustração causada pela vontade de retorno ao passado.', 'disponibilidade para a exploração do prazer efêmero.'),
(66, 'ENEM', '<p>Mandioca, macaxeira, aipim e castelinha são nomes diferentes da mesma planta. Semáforo, sinaleiro e farol também significam a mesma coisa. O que muda é só o hábito cultural de cada região. A mesma coisa acontece com a Língua Brasileira de Sinais (Libras). Embora ela seja a comunicação oficial da comunidade surda no Brasil, existem sinais que variam em relação à região, à idade e até ao gênero de quem se comunica. A cor verde, por exemplo, possui sinais diferentes no Rio de Janeiro, Paraná e São Paulo. São os regionalismos na língua de sinais.</p><p>Essas variações são um dos temas da disciplina Linguística na língua de sinais, oferecida pela Universidade Estadual Paulista (Unesp) ao longo do segundo semestre. “Muitas pessoas pensam que a língua de sinais é universal, o que não é verdade”, explica a professora e chefe do Departamento de Linguística, Literatura e Letras Clássicas da Unesp. “Mesmo dentro de um mesmo país, ela sofre variação em relação à localização geográfica, à faixa etária e até ao gênero dos usuários”, completa a especialista.</p><p>Os surdos podem criar sinais diferentes para identificar lugares, objetos e conceitos. Em São Paulo, o sinal de “cerveja” é feito com um giro do punho como uma meia-volta. Em Minas, a bebida é citada quando os dedos indicador e médio batem no lado do rosto. Também ocorrem mudanças históricas. Um sinal pode sofrer alterações decorrentes dos costumes da geração que o utiliza.</p><p>Disponível em: www.educacao.sp.gov.br. Acesso em: 1 nov. 2021 (adaptado).</p><p><br></p><p>Nesse texto, a Língua Brasileira de Sinais (Libras)</p>', 'A', ' passa por fenômenos de variação linguística como qualquer outra língua.', 'apresenta variações regionais, assumindo novo sentido para algumas palavras.', 'sofre mudança estrutural motivada pelo uso de sinais diferentes para algumas palavras.', 'diferencia-se em todo o Brasil, desenvolvendo cada região a sua própria língua de sinais.', ' é ininteligível para parte dos usuários em razão das mudanças de sinais motivadas geograficamente.'),
(67, 'ENEM', '<p>Como é bom reencontrar os leitores da Revista da Cultura por meio de uma publicação com outro visual, conteúdo de qualidade e interesses ampliados! ]cultura[, este nome simples, e eu diria mesmo familiar, nasce entre dois colchetes voltados para fora. E não é por acaso: são sinais abertos, receptivos, propícios à circulação de ideias. O DNA da publicação se mantém o mesmo, afinal, por longos anos montamos nossas edições com assuntos saídos das estantes de uma grande livraria — e assim continuará sendo. Literatura, sociologia, filosofia, artes... nunca será difícil montar a pauta da revista porque os livros nos ensinam que monotonia é só para quem não lê.</p><p>HERZ, P. ]cultura[, n. 1, jun. 2018 (adaptado).</p><p><br></p><p>O uso não padrão dos colchetes para nomear a revista</p><p>atribui-lhes uma nova função e está correlacionado ao(à)</p><p><br></p>', 'D', 'perfil de público-alvo, constituído por leitores exigentes e especializados em leitura acadêmica.', 'propósito do editor, chamando a atenção para o rigor normativo nos textos da revista.', 'exclusividade na seleção temática, direcionada para a área das ciências humanas.', 'identidade da revista, voltada para a recepção e a promoção de ideias circulantes em livros.', 'padrão editorial dos artigos, organizados em torno de uma proposta de design inovador.'),
(68, 'ENEM', '<p>TEXTO I</p><p>Alegria, alegria</p><p>O sol nas bancas de revista</p><p>Me enche de alegria e preguiça Quem lê tanta notícia</p><p>Eu vou</p><p>Por entre fotos e nomes Os olhos cheios de cores</p><p>O peito cheio de amores vãos Eu vou</p><p>Por que não, por que não?</p><p>VELOSO, C. Alegria, alegria. Rio de Janeiro: Polygram, 1990 (fragmento).</p><p>TEXTO II</p><p>Anjos tronchos</p><p>Uns anjos tronchos do Vale do Silício Desses que vivem no escuro em plena luz Disseram vai ser virtuoso no vício</p><p>Das telas dos azuis mais do que azuis</p><p><br></p><p>Agora a minha história é um denso algoritmo Que vende venda a vendedores reais Neurônios meus ganharam novo outro ritmo E mais, e mais, e mais, e mais, e mais</p><p>VELOSO, C. Meu coco. Rio de Janeiro: Sony, 2021 (fragmento).</p><p>Embora oriundas de momentos históricos diferentes, essas letras de canção têm em comum a</p>', 'B', 'referência às cores como elemento de crítica a hábitos contemporâneos.', 'percepção da profusão de informações gerada pela tecnologia.', 'contraposição entre os vícios e as virtudes da vida moderna.', 'busca constante pela liberdade de expressão individual.', 'crítica à finalidade comercial das notícias.'),
(69, 'ENEM', '<p>“São tantas formas de matar um preto Que para alguns sua morte é justificada Devia tá fazendo coisa errada</p><p>Se não era bandido, um dia ia ser</p><p>Por ser PRETO sua morte é defendida O PRETO sempre merece morrer”.</p><p>A estrofe acima é do poeta e educador social Baticum Proletário, que atua na periferia de Fortaleza, no Ceará, preparando jovens — em quase sua totalidade negros</p><p>— para enfrentar as dificuldades impostas pelo racismo</p><p>estrutural no país.</p><p>É a partir da arte que Baticum consegue envolver a juventude em um projeto de fortalecimento dessa população ao promover batalhas de rimas, slams e saraus com temáticas que discutem os problemas sociais. Não por acaso, o tema mais explorado nas rimas, versos e prosas é a violência. De acordo com o mais recente Atlas da violência, em 2019, os negros representaram 77% das vítimas de homicídios, quase 30 assassinatos por 100 mil habitantes, a maioria deles jovens.</p><p>O Atlas revela ainda que um negro tem quase 2,7 vezes mais chance de ser morto do que um branco, o que justifica o movimento de resistência crescente no Brasil.</p><p>MENDONÇA, F. Disponível em: www.cartacapital.com.br.</p><p>Acesso em: 22 nov. 2021 (adaptado).</p><p><br></p><p>O uso de citação e de dados estatísticos nesse texto tem o objetivo de</p>', 'D', 'ressaltar a importância da poesia para denunciar a morte de negros, que cresce a cada dia.', 'destacar o crescimento exponencial da temática do preconceito na produção literária no Brasil.', 'demonstrar o incremento no quantitativo de expressões artísticas na discussão de problemas sociais.', 'evidenciar argumentos que reforçam a ideia de que os negros são vítimas em potencial da violência.', ' salientar o aumento da participação de jovens nos movimentos de resistência na área da cultura.'),
(70, 'ENEM', '<p>No princípio era o verbo. A frase que abre o primeiro capítulo do Evangelho de João e remete à criação do mundo, assim como também faz o Gênesis, é a mais famosa da Bíblia. A ideia de que o mundo é criado pela palavra, porém, é tão estruturante que está presente em outras religiões, para muito além das fundadas no cristianismo. Como humanos, a linguagem é o mundo que habitamos. Basta tentar imaginar um mundo em que não podemos usar palavras para dizer de nós e dos outros para compreender o que isso significa. Ou um mundo em que aquilo que você diz não é entendido pelo outro, e o que o outro diz não é entendido por você.</p><p>O que acontece então quando a palavra é destruída e, com ela, a linguagem?</p><p>Durante séculos, em diferentes sociedades e línguas,  é  importante  lembrar,  a  linguagem  serviu</p><p>— e ainda serve — para manter privilégios de grupos de poder e deixar todos os outros de fora. Quem entende linguagem de advogados, juízes e promotores, linguagem de médicos, linguagem de burocratas, linguagem de cientistas? A maior parte da população foi submetida à violência de propositalmente ser impedida de compreender a linguagem daqueles que determinam seus destinos.</p><p>Se o princípio é o verbo, o fim pode ser o silenciamento. Mesmo que ele seja cheio de gritos entre aqueles que já não têm linguagem comum para compreender uns aos outros.</p><p>BRUM, E. Disponível em: https://brasil.elpais.com. Acesso em: 5 nov. 2021.</p><p><br></p><p>Nesse texto, a estratégia usada para convencer o leitor de que uma grande parcela da população não compreende a linguagem daqueles que detêm o poder foi</p>', 'E', 'revelar a origem religiosa da linguagem.', 'questionar o temor sobre o futuro da linguagem.', 'descrever a relação entre sociedade e linguagem.', 'apresentar as consequências do esfacelamento da linguagem.', 'criticar o obstáculo promovido pelos usos especializados da linguagem.'),
(71, 'ENEM', '<p>Um grupo de pesquisadores da Universidade Federal do Ceará desenvolveu um dicionário para traduzir sintomas de doenças da linguagem popular para os termos médicos. Defruço, chanha e piloura, por exemplo, podem ser termos conhecidos para muitos, mas, durante uma consulta médica, o desconhecimento pode significar um diagnóstico errado.</p><p>“Isso é um registro histórico e pode ser muito útil para estudos dessas comunidades, na abordagem médica delas. É de certa forma pioneiro no Brasil e, sem dúvida, um instrumento de trabalho importante, porque a comunicação é fundamental na relação médico-paciente”, avalia o reitor da instituição.</p><p>Disponível em: https://g1.globo.com. Acesso em: 1 nov. 2021 (adaptado).</p><p><br></p><p>Ao registrarem usos regionais de termos da área médica, pesquisadores</p>', 'D', 'apontaram erros motivados pelo desconhecimento da variedade linguística local.', 'explicaram problemas provocados pela incapacidade de comunicação.', 'descobriram novos sintomas de doenças existentes na comunidade.', 'propiciaram melhor compreensão dos sintomas dos pacientes.', 'divulgaram um novo rol de doenças características da localidade.'),
(72, 'ENEM', '<p>A sessão do Comitê Olímpico Internacional (COI) aprovou uma mudança histórica e inédita no lema olímpico, criado em 1894 pelo Barão Pierre de Coubertin para expressar os valores e a excelência do esporte. Mais de 120 anos depois, o lema tem sua primeira alteração para ressaltar a solidariedade e incluir a palavra “juntos”: mais rápido, mais alto, mais forte — juntos. A mudança foi aprovada por unanimidade pelos membros do COI e celebrada pelo presidente da entidade.</p><p>Disponível em: https://ge.globo.com. Acesso em: 10 nov. 2021 (adaptado).</p><p><br></p><p>De acordo com o texto, a alteração do lema olímpico teve como objetivo a</p>', 'D', 'unificação do lema anterior ao atual.', 'aproximação entre o lema olímpico e o COI.', 'junção do lema olímpico com os princípios esportivos.', 'associação entre o lema olímpico e a cooperatividade.', ' vinculação entre o lema olímpico e os eventos atléticos.'),
(73, 'ENEM', '<p>Mais iluminada que outras</p><p>Tenho dois seios, estas duas coxas, duas mãos que me são muito úteis, olhos escuros, estas duas sobrancelhas que preencho com maquiagem comprada por dezenove e noventa e orelhas que não aceitam bijuterias. Este corpo é um corpo faminto, dentado, cruel, capaz e violento. Movo os braços e multidões correm desesperadas. Caminho no escuro com o rosto para baixo, pois cada parte isolada de mim tem sua própria vida e não quero domá-las. Animal da caatinga. Forte demais. Engolidora de espadas e espinhos.</p><p>Dizem e eu ouvi, mas depois também li, que o estado do Ceará aboliu a escravidão quatro anos antes do restante do país. Todos aqueles corpos que eram trazidos com seus dedos contados, seus calcanhares prontos e seus umbigos em fogo, todos eles foram interrompidos no porto. Um homem — dizem e eu ouvi e depois também li — liderou o levante. E todos esses corpos foram buscar outros incômodos. Foram ser incomodados.</p><p>ARRAES, J. Redemoinho em dia quente. São Paulo: Alfaguara, 2019.</p><p>Nesse texto, os recursos expressivos usados pela narradora </p><p><br></p>', 'A', ' revelam as marcas da violência de raça e de gênero na construção da identidade.', 'questionam o pioneirismo do estado do Ceará no enfrentamento à escravidão.', 'reproduzem padrões estéticos em busca da valorização da autoestima feminina.', 'sugerem uma atmosfera onírica alinhada ao desejo de resgate da espiritualidade.', ' mimetizam, na paisagem, os corpos transformados pela violência da escravidão.'),
(74, 'ENEM', '<p>De quem é esta língua?</p><p>Uma pequena editora brasileira, a Urutau, acaba de lançar em Lisboa uma “antologia antirracista de poetas estrangeiros em Portugal”, com o título Volta para a tua terra.</p><p>O livro denuncia as diversas formas de racismo a que os imigrantes estão sujeitos. Alguns dos poetas brasileiros antologiados queixam-se do desdém com que um grande número de portugueses acolhe o português brasileiro. É uma queixa frequente.</p><p>“Aqui em Portugal eles dizem / — eles dizem — / que nosso português é errado, que nós não falamos português”, escreve a poetisa paulista Maria Giulia Pinheiro, para concluir: “Se a sua linguagem, a lusitana, / ainda conserva a palavra da opressão / ela não é a mais bonita do mundo./ Ela é uma das mais violentas”.</p><p>AGUALUSA, J. E. Disponível em: https://oglobo.globo.com.</p><p>Acesso em: 22 nov. 2021 (adaptado).</p><p>O texto de Agualusa tematiza o preconceito em relação ao português brasileiro. Com base no trecho citado pelo autor, infere-se que esse preconceito se deve</p><p><br></p>', 'C', 'à dificuldade de consolidação da literatura brasileira em outros países.', 'aos diferentes graus de instrução formal entre os falantes de língua portuguesa.', 'à existência de uma língua ideal que alguns falantes lusitanos creem ser a falada em Portugal.', 'ao intercâmbio cultural que ocorre entre os povos dos diferentes países de língua portuguesa.', 'à distância territorial entre os falantes do português que vivem em Portugal e no Brasil.');
