(75, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>Disponível em: www.cartoonstock.com. Acesso em: 25 out. 2021.</p><p><br></p><p>Ao retratar o ambiente de trabalho em um escritório, esse cartum tem por objetivo</p>', 'B', 'criticar um padrão de vestimenta.', 'destacar a falta de diversidade.', 'indicar um modo de interação.', 'elogiar um modelo de organização.', ' salientar o espírito de cooperação.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(76, 'ENEM', '<p>No man is an island, Entire of itself;</p><p>Every man is a piece of the continent, A part of the main.</p><p>[...]</p><p>Any man’s death diminishes me, Because I am involved in mankind.</p><p>DONNE, J. The Works of John Donne. Londres: John W. Parker, 1839 (fragmento).</p><p><br></p><p>Nesse poema, a expressão “No man is an island” ressalta o(a) </p>', 'B', 'medo da morte.', 'ideia de conexão.', 'conceito de solidão.', 'risco de devastação.', 'necessidade de empatia.');
