(77, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>Disponível em: https://mir-s3-cdn-cf.behance.net. Acesso em: 29 out. 2021 (adaptado).</p><p><br></p><p>Esse cartaz de campanha sugere que</p>', 'B', 'os lixões precisam de ampliação.', 'o desperdício degrada o ambiente.', 'os mercados doam alimentos perecíveis.', 'a desnutrição compromete o raciocínio.', ' as residências carecem de refrigeradores.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(78, 'ENEM', '<p>Things We Carry on the Sea</p><p>We carry tears in our eyes: good-bye father, good-bye</p><p>[mother</p><p>We carry soil in small bags: may home never fade in our [hearts</p><p>We carry carnage of mining, droughts, floods, genocides</p><p>We carry dust of our families and neighbors incinerated [in mushroom clouds</p><p>We carry our islands sinking under the sea</p><p>We carry our hands, feet, bones, hearts and best minds [for a new life</p><p>We carry diplomas: medicine, engineer, nurse, [education, math, poetry, even if they mean [nothing to the other shore</p><p>We carry railroads, plantations, laundromats, [bodegas, taco trucks, farms, factories, nursing [homes, hospitals, schools, temples... built on [our ancestors’ backs</p><p>We carry old homes along the spine, new dreams in our [chests</p><p>We carry yesterday, today and tomorrow We’re orphans of the wars forced upon us</p><p>We’re refugees of the sea rising from industrial wastes And we carry our mother tongues</p><p>[...]</p><p>As we drift... in our rubber boats... from shore... to shore... [to shore...</p><p>PING, W. Disponível em: https://poets.org. Acesso em: 1 jun. 2023 (fragmento).</p><p><br></p><p>Ao retratar a trajetória de refugiados, o poema recorre à imagem de viagem marítima para destacar o(a)</p>', 'D', ' risco de choques culturais.', 'impacto do ensino de história.', 'importância da luta ambiental.', 'existência de experiências plurais.', 'necessidade de capacitação profissional.'),
(79, 'ENEM', '<p>Spanglish</p><p>pues estoy creando Spanglish</p><p>bi-cultural systems scientific lexicographical inter-textual integrations two expressions existentially wired</p><p>two dominant languages continentally abrazándose in colloquial combate imperio spanglish emerges sobre territorio bi-lingual las novelas mexicanas mixing with radiorocknroll immigrant/migrant</p><p>nasal mispronouncements</p><p>hip-hop, street salsa, spanish pop</p><p>standard english classroom with computer technicalities spanglish is literally perfect</p><p>LAVIERA, T. Benedición: The Complete Poetry of Tato Laviera. Houston: Arte Público Press, 2014 (fragmento).</p><p><br></p><p>Nesse poema de Tato Laviera, o eu lírico destaca uma</p>', 'A', 'convergência linguístico-cultural.', 'característica histórico-cultural.', 'tendência estilístico-literária.', 'discriminação cultural.', 'censura musical.'),
(80, 'ENEM', '<p>Me niego rotundamente A negar mi voz,</p><p>Mi sangre y mi piel.</p><p>Y me niego rotundamente A dejar de ser yo,</p><p>A dejar de sentirme bien</p><p>Cuando miro mi rostro en el espejo Con mi boca</p><p>Rotundamente grande, Y mi nariz Rotundamente hermosa, Y mis dientes Rotundamente blancos,</p><p>Y mi piel valientemente negra.</p><p>Y me niego categóricamente A dejar de hablar</p><p>Mi lengua, mi acento y mi historia.</p><p>Y me niego absolutamente</p><p>A ser parte de los que callan, De los que temen,</p><p>De los que lloran.</p><p>Porque me acepto Rotundamente libre, Rotundamente negra, Rotundamente hermosa.</p><p>CAMPBELL BARR, S. Disponível em: https://negracubanateniaqueser.com.</p><p>Acesso em: 25 out. 2021.</p><p>Para enfatizar características e atitudes que reforçam a identidade da mulher negra, o poema da escritora costarriquenha apresenta</p><p><br></p>', 'A', 'advérbios como “rotundamente” e “categóricamente”.', 'verbos reflexivos como “me niego” e “me acepto”.', 'adjetivos como “grande” e “hermosa”.', 'substantivos como “sangre” e “piel”.', 'adjetivos possessivos como “mi” e “mis”.'),
(81, 'ENEM', '<p>Técnicas de manipulación y el resultado</p><p>Manipular es sembrar en la conciencia y en la mente de la gente ideas, actitudes, conceptos y aspiraciones</p><p>— incluso falsas e inmorales — que sirvan a los objetivos de sus manipuladores.</p><p>Manipular es una de las primeras cosas que aprendemos en la vida. A muy temprana edad, los bebés descubren el poder del llanto, el berrinche, los pataleos, la risa o alguna “gracia” como recursos para demandar atención, exigir comida, pedir ayuda o simplemente mantener ocupada a la gente. Nuestras actitudes de adultos reflejan lo mucho o poco que algunos maduraron, procesaron y rebasaron ese periodo.</p><p>Para que exista un manipulador, debe haber una base de ciudadanos indefensos, dóciles, desinformados.</p><p>El manipulador es celoso, a veces casi paranoico; no admite cuestionamientos ni quiere que nadie ocupe su espacio, sabe que su vigencia depende de presencia controladora. Todos los días, hay que marcar la línea de discurso, incidir en el debate. El ridículo vale la pena si con ello se logra una cortina de humo.</p><p>Disponível em: www.forbes.com.mx. Acesso em: 7 out. 2021 (adaptado).</p><p><br></p><p>Nesse texto, a expressão “cortina de humo” revela que o manipulador</p>', 'B', ' amadurece tardiamente.', 'busca mascarar a verdade.', 'rejeita questionamentos alheios.', 'aproxima-se de pessoas indefesas.', 'faz-se presente de forma controladora.'),
(82, 'ENEM', '<p>Que quede claro</p><p>Cómo es posible que se cierren tantas bocas, tantos ojos,</p><p>tantas puertas, muchas mentes ante un acto xenofóbico sin precedentes.</p><p>Presidentes, ministros, cancilleres, autoridades, responsables.</p><p>¿Quién pagará el daño causado a familiares? Por un loco del estrada sin modales. [...]</p><p>Se alejó de aquel lugar donde su color era mucho más que su color, era su raza.</p><p>Persiguiendo un sueño que desapareció,</p><p>que se fusionó y terminó en una pesadilla. [...]</p><p>Déjame que te cuente esta historia que sucedió en el metro de Barcelona, cuando aquella mañana la injusticia</p><p>y xenofobia se juntaron de la mano,</p><p>protagonizando una de las más feas escenas de racismo.</p><p>En aquel vagón viajaba un ángel de color diferente, en su camino se interpuso aquel inconsciente,</p><p>que aún sabiendo lo que hacía, seguía hablando con su gente.</p><p>Le dio al ángel dos patadas en su cara, se rió de ella sin cambiar la mirada.</p><p>Y aún anda suelto, aún anda suelto...</p><p>ORISHAS. In: Cosita buena. Delaware: Suerte Publishing LLC, 2008 (fragmento).</p><p><br></p><p>A letra da canção Que quede claro, da banda cubana Orishas, revela o(a)</p>', 'A', 'indignação diante do desrespeito à diversidade.', 'violência característica das grandes metrópoles.', 'preconceito da sociedade com relação ao misticismo.', 'descuido da população com os sonhos dos imigrantes.', 'falta de segurança existente no transporte público urbano.'),
(83, 'ENEM', '<p>“Caramelos” en sus suelos</p><p>Las tierras de España, tu vista enamoran;</p><p>sus gentes; te amistan; ¿“cocinas”?, ¡“te molan”!</p><p>¿El plato común?, ¡pues «tortilla/patatas»!; en bares, figones, o tascas, ¡las «tapas»!;</p><p>“sabor nacional”, ¡el «gazpacho», sus «vinos»,</p><p>«sangría», y «jamón» de sabrosos cochinos! (Cual “sellos”, te grabas sus «Típicos Platos»;</p><p>¡sabrás por dó pasas, por sólo tu olfato!,</p><p>¡si en cada lugar, un sabor peculiar, “al paso” cautiva tu buen paladar!).</p><p>¡Son más que “recetas”!, ¡será “alegoría”!,</p><p>¡será “identidad”! (¡hay “reserva” en su «Guía»!);</p><p>son platos allende un “timón conductor”,</p><p>¡son mar, ríos, sierras!, ¡son valles, son flor!,</p><p>¡y aportan “Conventos” a gastronomía,</p><p>sus «dulces»! (sabor “celestial”, ¡de ambrosía!).</p><p>QUIROZ Y LÓPEZ, M. Disponível em: https://pt.calameo.com. Acesso em: 25 out. 2021.</p><p>Nesse poema, o eu poético enaltece a</p>', 'E', 'característica amistosa do povo espanhol.', 'beleza das paisagens naturais da Espanha.', 'variedade de pratos na gastronomia espanhola.', 'relação entre os sentidos do paladar e do olfato na gastronomia.', 'gastronomia como representação da identidade cultural de um povo');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(84, 'ENEM', '<p>TEXTO I</p><p>QUÉ ME PASA?:</p><p>PORQUÉ ME CUESTA TANTO ESTUDIAR? PORQUÉ ME CUESTA TANTO CONCENTRARME? PORQUÉ......</p><p>PORQUÉ......</p><p><br></p><p>PORQUÉ NO CONSIGO APRENDER COMO LOS DEMÁS?</p><p><img src=\"data:image/png;base64,\"></p><p>Disponível em: www.otrasvoceseneducacion.org. Acesso em: 8 nov. 2022.</p><p><br></p><p>TEXTO II</p><p>Ishaan Awashi es un niño de 8 años cuyo mundo está plagado de maravillas que nadie más parece apreciar: colores, peces, perros y cometas, que simplemente no son importantes en la vida de los adultos, que parecen más interesados en cosas como los deberes, las notas o la limpieza. E Ishaan parece no poder hacer nada bien en clase. Cuando los problemas que ocasiona superan a sus padres, es internado en un colegio para que le disciplinen. Las cosas no mejoran en el nuevo colegio, donde Ishaan tiene además que aceptar estar lejos de sus padres. Hasta que un día, el nuevo profesor de arte, Ram Shankar Nikumbh, entra en escena, se interesa por el pequeño Ishaan y todo cambia.</p><p>Disponível em: https://elfinalde.com. Acesso em: 26 out. 2021 (adaptado).</p><p><br></p><p>O filme Como estrellas en la tierra aborda o tema da dislexia. Relacionando o cartaz do filme com a sinopse, constata-se que o(a)</p>', 'A', 'olhar diferenciado para com o outro gera mudanças.', 'estudante com dislexia apresenta um tom questionador.', 'abordagem para lidar com a dislexia é pautada na disciplina.', 'contato com os pais prejudica o acompanhamento da dislexia.', 'mudança de interesses ocorre na transição da infância para a vida adulta.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(85, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>PIVETTA, M. O clima no Antropoceno. Revista Pesquisa Fapesp, n. 307, set. 2021.</p><p><br></p><p>Qual medida é capaz de minimizar as mudanças apresentadas nas simulações? </p>', 'D', 'Expandir o transporte marítimo.', 'Incentivar os fluxos migratórios.', 'Monitorar as atividades vulcânicas.', 'Controlar as emissões de carbono.', 'Priorizar a utilização de termoelétricas.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(86, 'ENEM', '<p>Não tinha outra filosofia. Nem eu. Não digo que a Universidade me não tivesse ensinado alguma; mas eu decorei-lhe só as fórmulas, o vocabulário, o esqueleto. Tratei-a como tratei o latim; embolsei três versos de Virgílio, dois de Horácio, uma dúzia de locuções morais e políticas, para as despesas da conversação. Tratei-os como tratei a história e a jurisprudência. Colhi de todas as cousas a fraseologia, a casca, a ornamentação.</p><p>ASSIS, M. Memórias póstumas de Brás Cubas. Belo Horizonte: Autêntica, 1999.</p><p><br></p><p>A descrição crítica do personagem de Machado de Assis assemelha-se às características dos sofistas, contestados pelos filósofos gregos da Antiguidade, porque se mostra alinhada à</p>', 'B', 'elaboração conceitual de entendimentos.', 'utilização persuasiva do discurso.', 'narração alegórica dos rapsodos.', 'investigação empírica da physis.', ' expressão pictográfica da pólis.'),
(87, 'ENEM', '<p>A Cavalgada de Sant’Ana é uma expressão da devoção dos vaqueiros à padroeira de Caicó (RN). Nas décadas de 1950 a 1970, esse evento, então denominado Cavalaria, era celebrado pelas pessoas que residiam na zona rural do município de Caicó. Essas pessoas usavam os animais (jegues, mulas e cavalos) como único meio de transporte, sobretudo para se dirigirem à cidade nos dias de feiras, trazendo seus produtos para comercializarem. Estando em Caicó no período da Festa de Sant’Ana, esses agricultores se organizavam em cavalgada até o pátio da Catedral de Sant’Ana para louvar a santa e receber bênção para seus animais. Por volta da década de 1970, com a chegada do automóvel à zona rural do município, essa expressão cultural foi extinta. O meio de transporte utilizando os animais passou a ser substituído por carros, sobretudo caminhonetes e caminhões, que transportavam os camponeses para a cidade em dias de feiras e festas. Desde 2002, um grupo de caicoenses retomou essa expressão cultural e, em conjunto com a associação dos vaqueiros, realiza no primeiro domingo da Festa a Cavalgada de Sant’Ana. O evento, além de contar com a participação dos cavaleiros que residem nas zonas rurais, atrai também pessoas que residem em Caicó, cidades vizinhas e amantes das vaquejadas.</p><p>FESTA DE SANT’ANA. Disponível em: http://portal.iphan.gov.br.</p><p>Acesso em: 12 out. 2021 (adaptado).</p><p><br></p><p>As	mudanças	culturais	mencionadas	no	texto</p><p>caracterizam-se pela presença de</p>', 'A', 'elementos tradicionais e modernos em torno de uma crença religiosa.', 'argumentos teológicos e históricos em consequência de uma ordem papal.', 'fundamentos estéticos e etnográficos em função de uma cerimônia clerical.', 'práticas corporais e esportivas em decorrência de uma imposição eclesiástica.', 'discursos filosóficos e antropológicos em resultado de uma determinação paroquial.'),
(88, 'ENEM', '<p>Do século XVI em diante, pelo menos nas classes mais altas, o garfo passou a ser usado como utensílio para comer, chegando através da Itália primeiramente à França e, em seguida, à Inglaterra e à Alemanha, depois de ter servido, durante algum tempo, apenas para retirar alimentos sólidos da travessa. Henrique III introduziu-o na França, trazendo-o provavelmente de Veneza. Seus cortesãos não foram pouco ridicularizados por essa maneira “afetada” de comer e, no princípio, não eram muito hábeis no uso do utensílio: pelo menos se dizia que metade da comida caía do garfo no caminho do prato à boca. Em data tão recente como o século XVII, o garfo era ainda basicamente artigo de luxo, geralmente feito de prata ou ouro.</p><p><br></p><p>O processo social relatado indica a formação de uma etiqueta que tem como princípio a</p>', 'A', 'distinção das classes sociais.', 'valorização de hábitos de higiene.', 'exaltação da cultura mediterrânea.', 'consagração de tradições medievais.', ' disseminação de produtos manufaturados.'),
(89, 'ENEM', '<p>Negar o pedido por dinheiro indispensável para necessidades pessoais ou comprar bens usando o nome da pessoa sem o consentimento dela. Ameaçar o corte de recursos dependendo de atitudes pessoais, esconder documentos ou trocar senhas do banco sem avisar. Ou, ainda, proibir a pessoa de trabalhar ou destruir seus pertences. As histórias são comuns, mas às vezes não são reconhecidas como abuso. Mas é uma das cinco formas de conduta contra a mulher previstas na Lei Maria da Penha.</p><p>LEWGOY, J. Conduta quase invisível destrói a vida de mulheres. Disponível em:</p><p>https://valorinveste.globo.com. Acesso em: 23 out. 2021 (adaptado).</p><p><br></p><p>O texto apresenta tipos de conduta sujeitos a punição, conforme previsto na Lei Maria da Penha, porque consistem em formas de</p>', 'D', 'ação difamatória.', 'desvio comportamental.', 'expressão preconceituosa.', 'violência patrimonial.', 'desentendimento matrimonial.'),
(90, 'ENEM', '<p>Por trás da “mágica” do Google Assistant de sua capacidade de interpretar 26 idiomas está uma enorme equipe de linguistas distribuídos globalmente, trabalhando como subcontratados, que devem rotular tediosamente os dados de treinamento para que funcione. Eles ganham baixos salários e são rotineiramente forçados a trabalhar horas extras não remuneradas. A inteligência artificial não funciona com um pozinho mágico. Ela funciona por meio de trabalhadores que treinam algoritmos incansavelmente até que eles automatizem seus próprios trabalhos.</p><p>A Inteligência Artificial (IA) da economia freelancer está vindo atrás de você.</p><p>Disponível em: https://mittechreview.com.br. Acesso em: 6 out. 2021 (adaptado).</p><p><br></p><p>O texto critica a mudança tecnológica em razão da seguinte consequência:</p>', 'E', 'Diversificação da função.', 'Mobilidade da população.', 'Autonomia do empregado.', 'Concentração da produção.', 'Invisibilidade do profissional.'),
(91, 'ENEM', '<p>Os séculos XV e XVI, quando se vão desmoronando as estruturas socioeconômicas da Idade Média perante os novos imperativos da Época moderna, constituem um momento-chave na história florestal de toda a Europa Ocidental. Abre-se, genericamente, um longo período de “crise florestal”, que se manifesta com acuidade nos países onde mais se desenvolvem as atividades industriais e comerciais. As necessidades em produtos lenhosos aumentam drasticamente com o crescimento do consumo nos mercados urbanos e nas regiões onde progridem a metalurgia e a construção naval, além da sua utilização na vida quotidiana de toda a população.</p><p>DEVY-VARETA, N. Para uma geografia histórica da floresta portuguesa.</p><p>Revista da Faculdade de Letras — Geografia, n. 1, 1986 (adaptado).</p><p><br></p><p>Qual acontecimento do período contribuiu diretamente para o agravamento da situação descrita?</p>', 'A', 'O processo de expansão marítima.', 'A eclosão do renascimento cultural.', 'A concretização da centralização política.', 'O movimento de reformas religiosas.', ' A manutenção do sistema feudal.'),
(92, 'ENEM', '<p>Tahuantinsuyu — nome do Império Inca em quéchua — era dividido em quatro partes ou suyus: Chinchaysuyu (noroeste do Peru e Equador), Antisuyu (parte amazônica do império), Collasuyu (atual Bolívia) e Condesuyu (costa do Oceano Pacífico) e tinha Cuzco, no atual Peru, como sua capital imperial. Oficialmente, todas as etnias dominadas pelos incas deveriam adotar a língua quéchua, adorar o Sapa Inca e o Sol e pagar taxas em forma de horas de trabalhos periódicos. No entanto, pode-se dizer que o Império Inca era como um mosaico cultural em que vários e diferentes grupos étnicos adoravam o Sapa Inca e o Sol mas, simultaneamente, continuavam a adorar seus deuses locais e também a falar em suas línguas nativas.</p><p>MARTINS, C. Os incas e os tahuantinsuyu: apresentação. Disponível em:</p><p>http://antigo.anphlac.org. Acesso em: 6 out. 2021 (adaptado).</p><p><br></p><p>Ao comparar, no texto, a vertente da dominação territorial com os aspectos culturais, os incas tinham uma postura</p>', 'D', 'aceitável no que alude aos direitos humanos.', 'admissível no que remete às crenças coloniais.', 'tolerável no que se refere aos regimes tributários.', 'flexível no que diz respeito aos costumes religiosos.', 'compreensível no que concerne às normas laborais.'),
(93, 'ENEM', '<p>A torcida do Fluminense inicia um movimento para mudar a letra de uma das músicas mais populares das arquibancadas tricolores. Grupos pedem a remoção do termo “mulambo imundo”, em uma provocação direta ao Flamengo. Mulambo é um termo que surgiu em Angola, na época da escravatura, e eles eram chamados de mulambos pelos senhores de engenho, os patrões das fazendas.</p><p>Disponível em: https://oglobo.globo.com. Acesso em: 23 nov. 2021.</p><p><br></p><p>Qual mudança no comportamento social a proposta</p><p>reportada no texto reflete?</p>', 'C', 'Rejeição de costumes elitistas.', 'Repulsão de condutas misóginas.', 'Condenação do preconceito racial.', 'Criminalização de práticas homofóbicas.', 'Contestação do comportamento machista.'),
(94, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>Fonte: IBGE</p><p>Disponível em: www.insper.edu.br. Acesso em: 27 set. 2021 (adaptado).</p><p><br></p><p>Qual fator foi determinante para a mudança do indicador</p><p>apresentado no gráfico?</p>', 'D', 'Flexibilização legal da prática de aborto.', 'Envelhecimento da população brasileira.', 'Crescimento dos casos de gravidez precoce.', 'Participação feminina no mercado de trabalho.', ' Diminuição dos benefícios na licença-maternidade.'),
(95, 'ENEM', '<p>No cemitério, a sociedade religiosa encarregada do funeral, aterrorizada, apressou a cerimônia de tal forma que a mãe de Herzog perdeu o momento em que o caixão do filho começou a ser coberto pela terra. Quatro jornalistas que estavam presos no DOI chegaram para assistir ao sepultamento. Um se afastara, chorando. Dizia: Eles matam, eles matam! Não pergunte nada. Não podemos dizer nada. Eles matam mesmo. Falava-se baixo. Ouviram-se dois curtos discursos. O primeiro, da atriz Ruth Escobar: Até quando vamos suportar tanta violência? Até quando vamos continuar enterrando nossos mortos em silêncio? No segundo, Audálio Dantas recitou o Navio negreiro, de Castro Alves: Senhor Deus dos desgraçados / Dizei-me Vós, Senhor Deus / Se é mentira, se é verdade, / Tanto horror perante os céus.</p><p>GASPARI, E. A ditadura encurralada. São Paulo: Cia. das Letras, 2004.</p><p><br></p><p>O acontecimento descrito no texto, ocorrido em meados dos anos 1970, atesta a seguinte característica do regime político-institucional vigente:</p>', 'C', 'Incorporação da estética popular para justificar o ideal de integração nacional.', 'Afirmação da estratégia psicossocial para favorecer o objetivo de propaganda cívica.', 'Institucionalização de mecanismos repressivos para eliminar os focos de resistência.', 'Adoção de cerimoniais públicos para controlar as manifestações de grupos opositores.', 'Estatização de meios de comunicação para selecionar a divulgação de atos governamentais.'),
(96, 'ENEM', '<p>Alternativas logísticas estão servindo de instrumentos que ativam os mercados especuladores de terras nas diferentes regiões da Amazônia e constituem em indicadores utilizados por diferentes atores para defender ou denunciar o avanço da cultura da soja na região e, com ela, a retomada do desmatamento. É evidente que o crescimento do desmatamento tem a ver também com a expansão da soja, porém atribuir a ela o fator principal parece não totalmente correto. Parto da compreensão central de que a lógica que gera o desmatamento está articulada pelo tripé grileiros, madeireiros e pecuaristas.</p><p>OLIVEIRA, A. U. A Amazônia e a nova geografia da produção da soja.</p><p>Terra Livre, n. 26, jan.-jun. 2006 (adaptado).</p><p><br></p><p>Na visão do autor, o problema central da situação descrita é desencadeado pela</p><p><br></p>', 'A', 'apropriação de áreas devolutas.', 'sonegação de impostos federais.', 'incorporação de exportação ilegal.', 'desoneração de setores produtivos.', 'flexibilização de legislação ambiental.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(97, 'ENEM', '<p>TEXTO I</p><p>Por hora, apenas os mais abastados poderão sonhar em viajar ao espaço, seja por um foguete ou por um avião híbrido, mas toda a população global poderá sentir os efeitos dessas viagens e avanços tecnológicos. Para uma aventura dessas, as empresas tiveram que criar novas tecnologias que podem, em algum momento, voltar para a sociedade. A câmera fotográfica, hoje comum no mundo, antes foi uma invenção para ser usada em telescópios, e o titânio, usado até na medicina, foi desenvolvido para a construção de foguetes.</p><p>ORLANDO, G. Corrida espacial dos bilionários pode trazer vantagens para todos.</p><p>Disponível em: https://noticias.r7.com. Acesso em: 5 nov. 2021 (adaptado).</p><p><br></p><p>TEXTO II</p><p><img src=\"data:image/png;base64,\"></p><p>CAZO. Disponível em: www.humorpolitico.com.br. Acesso em: 5 nov. 2021.</p><p><br></p><p>Os textos apresentam perspectivas da nova corrida espacial que revelam, respectivamente:</p>', 'B', 'Dependência e progresso.', 'Expectativa e desconfiança.', 'Angústia e adaptação.', 'Pioneirismo e retrocesso.', 'Receio e civilidade.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(98, 'ENEM', '<p>A economia das ilegalidades se reestruturou com o desenvolvimento da sociedade capitalista. A ilegalidade dos bens foi separada da ilegalidade dos direitos. Divisão que corresponde a uma oposição de classes, pois, de um lado, a ilegalidade mais acessível às classes populares será a dos bens — transferência violenta das propriedades; de outro, à burguesia, então, se reservará a ilegalidade dos direitos: a possibilidade de desviar seus próprios regulamentos e suas próprias leis; e essa grande redistribuição das ilegalidades se traduzirá até por uma especialização dos circuitos judiciários; para as ilegalidades de bens — para o roubo — os tribunais ordinários e os castigos; para as ilegalidades de direitos — fraudes, evasões fiscais, operações comerciais irregulares — jurisdições especiais com transações, acomodações, multas atenuadas etc.</p><p>FOUCAULT, M. Vigiar e punir: nascimento da prisão. Petrópolis: Vozes, 1987.</p><p><br></p><p>O texto apresenta uma relação de cálculo político-econômico</p><p>que caracteriza o poder punitivo por meio da</p>', 'A', 'gestão das ilicitudes pelo sistema judicial.', 'aplicação das sanções pelo modelo equânime.', 'supressão dos crimes pela penalização severa.', 'regulamentação dos privilégios pela justiça social.', 'repartição de vantagens pela hierarquização cultural.'),
(99, 'ENEM', '<p>Os vapores cruzavam os mares transportando pessoas, mercadorias e ideias, e ainda carregavam a mala postal, repleta de mensagens. Múltiplas histórias escritas atravessavam o oceano buscando por notícias de filhos e pais, irmãos, maridos e esposas, noivos e noivas. As missivas traziam boas e más novas, comunicavam alegremente nascimentos e casamentos, também doenças e mortes; enviavam declarações de amor e fidelidade, fotos de família; encaminhavam conselhos de velhos, pedidos de ajuda e de dinheiro; expediam cartas bancárias e de chamada. Essa literatura epistolar possibilitava a transmissão e reconstrução das tradições. Os deslocamentos tornaram-se um dos mais potentes produtores de escritura ao longo da história.</p><p>TRUZZI, O.; MATOS, I. Saudades: sensibilidades no epistolário de e/imigrantes portugueses (Portugal-Brasil 1890-1930). Rev. Bras. Hist., n. 70, jul.-dez. 2015.</p><p><br></p><p>Conforme o texto, as correspondências trocadas entre imigrantes no Brasil com os seus países de procedência constituíam um dispositivo tecnológico que possibilitava o(a)</p>', 'B', 'disputa ideológica entre a comunidade de estrangeiros e a de nativos.', 'circularidade cultural entre a sociedade de partida e a de acolhimento.', 'controle doutrinário das narrativas do cotidiano de origem e de destino.', 'fiscalização política dos fluxos de populações do Novo e do Velho Mundo.', ' monitoramento social dos grupos de trabalhadores da cidade e do campo.'),
(100, 'ENEM', '<p>Diversos são os fatores causadores da degradação do solo, atuando de forma direta ou indireta, mas quase sempre a grande maioria das terras degradadas inicia esse processo com o desmatamento, que pode ser seguido por diversas formas de ocupação desordenada, como: corte de taludes para a construção de casas, rodovias e ferrovias, agricultura, com uso da queimada, vários tipos de mineração, irrigação excessiva, crescimento desordenado das cidades, superpastoreio, uso do solo para diversos tipos de despejos industriais e domésticos, sem tratamento da área que recebe esses despejos; enfim, de uma forma ou de outra, os solos tornam-se degradados, sendo muitas vezes difícil, ou quase impossível, a sua recuperação.</p><p>GUERRA, A. T. Degradação dos solos: conceitos e temas. In: GUERRA, A. T.; JORGE, M. C. O. (Org.). Degradação dos solos no Brasil.</p><p>Rio de Janeiro: Difel, 2018.</p><p><br></p><p>A partir da ocupação desordenada exposta no texto, o que impede a recuperação do recurso natural destacado é a</p>', 'C', 'elevação da biomassa.', 'redução da salinização.', 'diminuição da fertilidade.', 'ampliação da microfauna.', 'decomposição do substrato.'),
(101, 'ENEM', '<p>A partir da década de 1930, começam a ser discutidos no Brasil os princípios de racionalização do trabalho. As preocupações com a cozinha e o trabalho doméstico foram introduzidas com a medicina sanitária e a oferta de gás e eletricidade para uso doméstico no início do século XX. A organização da cozinha visava atingir uma simplificação das tarefas, com a economia de movimentos, e o barateamento dos equipamentos, a partir da produção em grande escala. A padronização e racionalização da habitação e seus componentes visava uma radical transformação da casa, em especial da cozinha, e apoiava-se tanto no desenvolvimento de novos equipamentos quanto nos estudos de racionalização do trabalho doméstico. A principal preocupação era o desenvolvimento de um novo tipo de habitação, que deveria induzir um novo comportamento social.</p><p>SILVA, J. L. M. Transformações no espaço doméstico: o fogão a gás e a cozinha</p><p>paulistana, 1870-1930. Anais do Museu Paulista, n. 2, jul.-dez. 2007 (adaptado).</p><p><br></p><p>No contexto descrito, as mudanças mencionadas proporcionavam às mulheres o(a)</p>', 'D', 'controle do orçamento familiar.', 'libertação das tradições religiosas.', 'exercício da representatividade política.', 'ampliação dos momentos de socialização.', 'afastamento das atividades especializadas.'),
(102, 'ENEM', '<p>Produtores rurais europeus são antigos opositores de um grande acordo com o Mercosul. Na visão deles, existe um nítido risco de concorrência desleal, pois, na Europa, é preciso seguir regras mais rígidas de produção, o que encarece o processo. Assim, eles não conseguiriam competir com os preços, por exemplo, da carne brasileira e teriam seus negócios ameaçados. Por outro lado, o setor industrial europeu se mobiliza a favor do acordo, uma vez que as reduções de tarifas no comércio internacional dariam maior acesso ao mercado sul-americano. Um exemplo é o setor automotivo europeu, que prevê maior participação e concorrência nos países do Mercosul caso o acordo siga em frente.</p><p>ROUBICEK, M. Como o risco ambiental afeta o acordo entre Mercosul e União Europeia. Disponível em: www.nexojornal.com.br. Acesso em: 25 out. 2021.</p><p><br></p><p>No contexto do acordo citado, os dois grupos econômicos europeus defendem, respectivamente, a</p>', 'D', 'restrição dos fluxos migratórios e a maior atuação de sindicatos.', 'ampliação das leis trabalhistas e a plena importação de manufaturados.', 'proteção das florestas nacionais e a ampla transferência de tecnologias.', 'manutenção das barreiras fitossanitárias e a livre circulação de mercadorias.', ' remoção dos entraves alfandegários e a melhor remuneração de empregados.'),
(103, 'ENEM', '<p>Durante a Revolução Francesa, um certo padre Niollant escondeu-se no pequeno castelo de L’Escarbas. Pagou amplamente a hospitalidade do velho fidalgo ocupando-se da educação de sua filha, Anaïs. A presença da mãe em nada modificou essa educação masculina dada a uma jovem criatura já muito inclinada à independência em virtude da vida no campo. O padre transmitiu à aluna sua intrepidez de opiniões e sua facilidade de julgamento, sem pensar que essas qualidades, tão necessárias num homem, se tornam defeitos numa mulher destinada aos humildes afazeres de mãe de família. Embora o padre recomendasse continuamente à aluna ser tanto mais graciosa e modesta quanto seu saber era mais extenso, a senhorita de Nègrepelisse ficou com excelente opinião de si mesma.</p><p>BALZAC, H. Ilusões perdidas. São Paulo: Penguin Classics;</p><p>Cia. das Letras, 2011 (adaptado).</p><p><br></p><p>O comportamento desenvolvido pela personagem evidencia uma postura de</p>', 'E', 'abandono de laços afetivos.', 'negação da ideia de subjetividade.', 'aceitação da hierarquia de gênero.', 'consolidação da estratificação social.', 'ruptura de valores institucionalizados.'),
(104, 'ENEM', '<p>TEXTO I</p><p>Oriunda da Romênia, Genny Gleizer aportou no Brasil em 1932. Assim como milhares de judeus do Leste Europeu, sua vinda para o Brasil ocorreu em um momento de ascensão do antissemitismo na Europa que tornava precárias suas vidas. O Brasil se colocava como uma possibilidade na busca por condições de sobrevivência e desenvolvimento.</p><p>ANTÃO, A. C. C. B. Gênero, imigração e política: o caso da judia comunista Genny Gleizer</p><p>no Governo Vargas (1932-1935). Rio de Janeiro: Casa de Oswaldo Cruz, 2017 (adaptado).</p><p>TEXTO II</p><p>A presença judaica no Brasil foi criando aos poucos certas desconfianças que se refletiram em órgãos da imprensa e em círculos intelectuais e políticos. Em parte, essa imagem negativa adviria da onda nacionalista surgida no final dos anos 1910, que concebia imigrantes como concorrentes dos trabalhadores brasileiros, ou como seres improdutivos, exploradores da mão de obra e da riqueza autóctone. Além disso, as elites políticas da época acreditavam que os estrangeiros eram portadores das doutrinas anarquista e comunista, estranhas à “índole do povo brasileiro”. Esses “indesejáveis” seriam um mal externo que corromperia a nação.</p><p>MAIO, M. C.; CALAÇA, C. E. Um balanço da bibliografia sobre o antissemitismo no Brasil. In: GRINBERG, K. (Org.). Os judeus no Brasil. Rio de Janeiro: Civilização Brasileira, 2005 (adaptado).</p><p><br></p><p>Conforme descrito nos textos, o tratamento dispensado aos grupos mencionados se fundamentava em</p>', 'B', 'preceitos teológicos e religiosos.', 'aspectos socioeconômicos e ideológicos.', 'regulamentações territoriais e alfandegárias.', 'orientações constitucionais e estatutárias.', 'decretos legislativos e internacionais.'),
(105, 'ENEM', '<p>Concorrer e competir não são a mesma coisa. A concorrência pode até ser saudável sempre que a batalha entre agentes, para melhor empreender uma tarefa e obter melhores resultados finais, exige o respeito a certas regras de convivência preestabelecidas ou não. Já a competitividade se funda na invenção de novas armas de luta, num exercício em que a única regra é a conquista da melhor posição. A competitividade é uma espécie de guerra em que tudo vale e, desse modo, sua prática provoca um afrouxamento dos valores morais e um convite ao exercício da violência.</p><p>SANTOS, M. Por uma outra globalização: do pensamento único à consciência universal. Rio de Janeiro: Record, 2006.</p><p><br></p><p>De acordo com a diferenciação feita pelo autor, que prática econômica é considerada moralmente condenável?</p>', 'A', 'Adoção do dumping comercial.', 'Fusão da função administrativa.', 'Criação de holding empresarial.', 'Limitação do mercado monopolista.', 'Modernização da produção industrial.'),
(106, 'ENEM', '<p>Havia já muito tempo que a Europa desfrutava os benefícios da vacina e arrancava à morte milhares de inocentes, condenados a serem vítimas do terrível flagelo das bexigas, e o governo de Portugal nunca se lembrara de transmitir ao Brasil a mais útil das descobertas humanas, quando aliás nenhum país mais do que ele carecia deste salutar invento ou se atendesse às vantagens da população ou ao perdimento de imensas somas na mortandade contínua de escravos, que este flagelo devorava. O certo é que mais ocupado de seu ouro que de seus habitantes, Portugal, como em outros muitos casos, esperou que o Brasil por seu próprio impulso remediasse a este mal.</p><p>PEREIRA, J. C. 12 jan. 1828 apud LOPES, M. B.; POLITO, R. Para uma história da vacina no Brasil: um manuscrito inédito de Norberto e Macedo. História, Ciências, Saúde — Manguinhos, n. 2, abr.-jun. 2007 (adaptado).</p><p><br></p><p>Escrito em 1828, o texto expressa a seguinte ideia de origem iluminista:</p>', 'E', 'As leis observáveis regem o mundo material.', 'O monarca racional promove a sociedade justa.', 'O direito natural justifica a liberdade dos homens.', 'A produção da terra garante a riqueza das nações.', 'A responsabilidade dos governantes assegura a saúde dos povos.'),
(107, 'ENEM', '<p>Os movimentos da agricultura urbana no Rio de Janeiro vêm crescendo nos últimos vinte anos, tanto por meio de reproduções de modelos de vida antigos, vinculados ao resgate dos próprios costumes, como — e cada vez mais — são revelados hábitos inventivos nos quais moradores urbanos de diferentes classes sociais, sem nenhuma referência anterior com o campo, passam a se dedicar a essas atividades. Ao possibilitar o acesso ao plantio e, consequentemente, à alimentação, permite-se uma nova relação com o que se come, reduzindo o percurso da cadeia produtiva e aproximando produtores de consumidores, pois ambos se confundem nas experiências de agricultura urbana.</p><p>PORTILHO, M.; RODRIGUES, C. G. O.; FERNANDEZ, A. C. F. Cultivando relações no</p><p>arranjo local da Penha: a mobilização de mulheres a partir das práticas de agricultura urbana na favela. Cidades, Comunidades e Territórios, n. 42, jun. 2021.</p><p><br></p><p>A prática agrícola destacada no texto apresenta como vantagem no espaço urbano a</p>', 'A', 'ocupação de lugares ociosos.', 'densificação da área central.', 'valorização do mercado externo.', 'priorização de insumos químicos.', 'mecanização de técnicas de cultivo.'),
(108, 'ENEM', '<p>TEXTO I</p><p>Gerineldo dorme porque já está conformado com o seu mundo. Porque já sabe tudo o que lhe pode acontecer após haver submetido todos os objetos que o rodeiam a um minucioso inventário de possibilidades. Seu apartamento, mais que um apartamento, é uma teoria de sorte e de azar. Melhor que ninguém, Gerineldo conhece o coeficiente da dilatação de suas janelas e mantém marcado no termômetro, com uma linha vermelha, o ponto em que se quebrarão os vidros, despedaçados em estilhaços de morte. Sabe que os arquitetos e os engenheiros já previram tudo, menos o que nunca já aconteceu.</p><p>MÁRQUEZ, G. G. O pessimista. In: Textos do Caribe. Rio de Janeiro: Record, 1981.</p><p><br></p><p>TEXTO II</p><p>A situação é o sujeito inteiro (ele não é nada a não ser a sua situação) e é também a coisa inteira (nunca há mais nada senão as coisas). É o sujeito a elucidar as coisas pela sua própria superação, se assim quisermos; ou são as coisas a reenviar ao sujeito a imagem dele. É a total facticidade, a contingência absoluta do mundo, do meu nascimento, do meu lugar, do meu passado, dos meus redores — e é a minha liberdade sem limites que faz com que haja para mim uma facticidade.</p><p>SARTRE, J.-P. O ser e o nada: ensaio de ontologia fenomenológica.</p><p>Petrópolis: Vozes, 1997 (adaptado).</p><p><br></p><p>postura determinista adotada pelo personagem Gerineldo contrasta com a ideia existencialista contida no pensamento filosófico de Sartre porque</p>', 'B', 'evidencia a manifestação do inconsciente.', 'nega a possibilidade de transcendência.', 'contraria o conhecimento difuso.', 'sustenta a fugacidade da vida.', 'refuta a evolução biológica.'),
(109, 'ENEM', '<p>O Golpe Militar de 1964 foi implacável no combate ao que restava das Ligas Camponesas, generalizadas na década anterior. No entanto, em relação aos sindicatos, sua atitude foi ambígua. Por meio de acordos com os Estados Unidos, foram concebidos centros sindicais e cursos de liderança com base em princípios conservadores e ministrados por membros da Igreja Católica.</p><p>DEL PRIORE, M.; VEN NCIO, R. Uma história da vida rural no Brasil.</p><p>Rio de Janeiro: Ediouro, 2006 (adaptado).</p><p><br></p><p>Os sindicatos rurais foram tratados da forma descrita no</p><p>texto porque o governo pretendia utilizá-los para</p><p><br></p>', 'A', 'controlar as tensões políticas.', 'limitar a legislação trabalhista.', 'divulgar o programa populista.', 'regularizar a propriedade da terra.', 'estimular a oferta de mão de obra.'),
(110, 'ENEM', '<p>Superar a história da escravidão como principal marca da trajetória do negro no país tem sido uma tônica daqueles que se dedicam a pesquisar as heranças de origem afro à cultura brasileira. A esse esforço de reconstrução da própria história do país, alia-se agora a criação da plataforma digital Ancestralidades. “A história do negro no Brasil vai continuar sendo contada, e cada passo que a gente dá para trás é um passo que a gente avança”, diz Márcio Black, idealizador da plataforma, sobre o estudo de figuras ainda encobertas pela perspectiva histórica imposta pelos colonizadores da América.</p><p>FIORATI, G. Projeto joga luz sobre negros e revê perspectiva histórica. Disponível em: www1.folha.uol.com.br. Acesso em: 10 nov. 2021 (adaptado).</p><p><br></p><p>Em relação ao conhecimento sobre a formação cultural brasileira, iniciativas como a descrita no texto favorecem o(a)</p>', 'E', 'recuperação do tradicionalismo.', 'estímulo ao antropocentrismo.', 'reforço do etnocentrismo.', 'resgate do teocentrismo.', 'crítica ao eurocentrismo.'),
(111, 'ENEM', '<p>Escrito durante a Primeira Guerra Mundial, o seguinte trecho faz parte da carta enviada pelo secretário do exterior britânico, Sir Arthur James Balfour, ao banqueiro Lord Rotschild, presidente da Liga Sionista, em 2 de novembro de 1917, a carta ficou conhecida como Declaração Balfour:</p><p>“O governo de Sua Majestade vê com aprovação o estabelecimento na Palestina de um lar nacional para o povo judeu, e fará todos os esforços para facilitar tal objetivo. Nada será feito que possa prejudicar os direitos civis e religiosos das comunidades não judaicas na Palestina.”</p><p>GATTAZ, A. A Guerra da Palestina. São Paulo: Usina do Livro, 2002 (adaptado).</p><p><br></p><p>A análise do resultado do processo em questão revela que o governo inglês foi incapaz de garantir seu objetivo de</p><p><br></p>', 'C', 'promover o bem-estar social.', 'negociar o apoio muçulmano.', 'mediar os conflitos territoriais.', 'estimular a cooperação regional.', 'combater os governos autocráticos.'),
(112, 'ENEM', '<p>TEXTO I</p><p>Como presença consciente no mundo não posso escapar à responsabilidade ética no meu mover-me no mundo. Se sou puro produto da determinação genética ou cultural ou de classe, sou irresponsável pelo que faço no meu mover-me no mundo e, se careço de responsabilidade, não posso falar em ética.</p><p>FREIRE, P. Pedagogia da autonomia: saberes necessários à prática educativa. São Paulo: Paz e Terra, 1996.</p><p><br></p><p>TEXTO II</p><p>Paulo Freire construiu uma pedagogia da esperança. Na sua concepção, a história não é algo pronto e acabado. As estruturas de opressão e as desigualdades, apesar de serem naturalizadas, são sócio e historicamente construídas. Daí a importância de os educandos tomarem consciência da sua realidade para, assim, transformá-la.</p><p>DEMARCHI, J. L. Paulo Freire. Disponível em: https://diplomatique.org.br.</p><p>Acesso em: 6 out. 2021 (adaptado).</p><p><br></p><p>Com base no conceito de ética pedagógica presente nos</p><p>textos, os educandos tornam-se responsáveis pela</p>', 'A', 'participação sociopolítica.', 'definição estético-cultural.', 'competição econômica local.', 'manutenção do sistema escolar.', 'capacitação de mobilidade individual.'),
(113, 'ENEM', '<p>A Cordilheira do Himalaia tem mais de 50 milhões de anos, sendo classificada como a maior cordilheira do planeta. Originário da língua sânscrito, comum na região, seu nome quer dizer “morada da neve”. É possível encontrar nessa cordilheira as quinze maiores montanhas do mundo. Ao todo, existem mais de cem picos, que contam com altitudes bem maiores que 7 000 m. O Everest, considerado o ponto mais alto da Terra, tem nada menos que 8 848 m de altitude, e continua crescendo, aproximadamente, 0,8 mm a cada ano.</p><p>Disponível em: https://meioambiente.culturamix.com. Acesso em: 12 nov. 2021 (adaptado).</p><p><br></p><p>Qual dinâmica natural é responsável pelo fenômeno apresentado?</p>', '', 'Derrame de lava vulcânica.', 'Encontro de placas tectônicas.', 'Ação do intemperismo químico.', 'Sedimentação de erosão eólica.', ' Derretimento de geleiras glaciais.'),
(114, 'ENEM', '<p>Eu poderia concluir que a raiva é um pensamento, que estar com raiva é pensar que alguém é detestável, e que esse pensamento, como todos os outros — assim como Descartes o mostrou —, não poderia residir em nenhum fragmento de matéria. A raiva seria, portanto, espírito. Porém, quando me volto para minha própria experiência da raiva, devo confessar que ela não estava fora do meu corpo, mas inexplicavelmente nele.</p><p>MERLEAU-PONTY, M. Quinta conversa: o homem visto de fora.</p><p>São Paulo: Martins Fontes, 1948 (adaptado).</p><p><br></p><p>No que se refere ao problema do corpo, a filosofia cartesiana apresenta-se como contraponto ao entendimento expresso no texto por</p>', 'A', 'apresentar uma visão dualista.', 'confirmar uma tese naturalista.', 'demonstrar uma premissa realista.', 'sustentar um argumento idealista.', 'defender uma posição intencionalista.'),
(115, 'ENEM', '<p>A diversão é o prolongamento do trabalho sob o capitalismo tardio. Ela é procurada por quem quer escapar ao processo de trabalho mecanizado para se pôr de novo em condições de enfrentá-lo. Mas, ao mesmo tempo, a mecanização atingiu um tal poderio sobre a pessoa em seu lazer e sobre a sua felicidade, ela determina tão profundamente a fabricação das mercadorias destinadas à diversão que essa pessoa não pode mais perceber outra coisa senão as cópias que reproduzem o próprio processo de trabalho.</p><p>ADORNO, T.; HORKHEIMER, M. Dialética do esclarecimento. Rio de Janeiro: Zahar, 1997.</p><p><br></p><p>No texto, o tempo livre é concebido como</p><p><br></p>', 'A', 'consumo de produtos culturais elaborados no mesmo sistema produtivo do capitalismo.', 'forma de realizar as diversas potencialidades da natureza humana.', 'alternativa para equilibrar tensões psicológicas do dia a dia.', 'promoção da satisfação de necessidades artificiais.', 'mecanismo de organização do ócio e do prazer.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(116, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>LAERTE. Disponível em: www.laerte.art.br. Acesso em: 23 nov. 2021 (adaptado).</p><p><br></p><p>A charge ilustra um anseio presente na sociedade contemporânea, que se caracteriza pela </p>', 'C', 'situação de revolta individual.', 'satisfação de desejos pessoais.', 'participação em ações decisórias.', 'permanência em passividade social.', 'conivência em interesses partidários.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(117, 'ENEM', '<p>Quem se mete pelo caminho do pedido de perdão deve estar pronto a escutar uma palavra de recusa. Entrar na atmosfera do perdão é aceitar medir-se com a possibilidade sempre aberta do imperdoável. Perdão pedido não é perdão a que se tem direito [devido]. É com o preço destas reservas que a grandeza do perdão se manifesta.</p><p>RICOEUR, P. O perdão pode curar. Disponível em: www.lusosofia.net. Acesso em: 14 out. 2019.</p><p><br></p><p>A reflexão sobre o perdão apresentada no texto encontra fundamento na(s)</p>', 'E', 'rejeição particular amparada pelo desejo de poder.', 'decisão subjetiva determinada pela vontade divina.', 'liberdade mitigada pela predestinação do espírito.', 'escolhas humanas definidas pelo conhecimento empírico.', 'relações interpessoais mediadas pela autonomia dos indivíduos.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(118, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>Fotografia da avó bordada</p><p>SCARELI, G. A máquina de costura e os fios da memória. Revista Brasileira</p><p>de Pesquisa (Auto)Biográfica, n. 18, maio-ago. 2021.</p><p><br></p><p>A definição de Sertão descrita no bordado associa esse</p><p>recorte espacial a</p>', 'C', 'percursos e roteiros turísticos.', 'trajetos e movimentos holísticos.', 'vivências e itinerários socioafetivos.', 'fronteiras e demarcações territoriais.', 'profissões e interesses econômicos.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(119, 'ENEM', '<p>Felizes tempos eram esses! As moças iam à missa de madrugada. De dia ninguém as via e se alguma, em dia de festa, queria passear com a avó ou a tia, havia de ir de cadeirinhas. Bem razão têm os nossos velhos de chorar por esses tempos, em que as filhas não sabiam escrever, e por isso não mandavam nem recebiam bilhetinhos.</p><p>Novo Correio de Modas, 1853, apud DONEGÁ, A. L. Publicar ficção em meados do século XIX: um estudo das revistas femininas editadas pelos irmãos Laemmert. Campinas: Unicamp, 2013 (adaptado).</p><p><br></p><p>Na perspectiva do autor, as tradições e os costumes sociofamiliares sofreram alterações, no século XIX, decorrentes de quais fatores?</p><p><br></p>', 'D', 'Hábitos de leitura e mobilidade regional.', 'Circulação de impressos e trânsito religioso.', 'Valorização da língua e imigração estrangeira.', 'Práticas de letramento e transformação cultural.', 'Flexibilização do ensino e reformismo pedagógico.'),
(120, 'ENEM', '<p>No Cerrado, o conhecimento local está sendo cada vez mais subordinado à lógica do agronegócio. De um lado, o capital impõe os conhecimentos biotecnológicos, como mecanismo de universalização de práticas agrícolas e de novas tecnologias, e de outro, o modelo capitalista subordina homens e mulheres à lógica do mercado. Assim, as águas, as sementes, os minerais, as terras (bens comuns) tornam-se propriedade privada. Além do mais, há outros fatores negativos, como a mecanização pesada, a “pragatização” dos seres humanos e não humanos, a violência simbólica, a superexploração, as chuvas de veneno e a violência contra a pessoa.</p><p>CALAÇA, M.; SILVA, E. B.; JESUS, J. N. Territorialização do agronegócio e subordinação</p><p>do campesinato no Cerrado. Élisée, Rev. Geo. UEG, n. 1, jan.-jun. 2021 (adaptado).</p><p><br></p><p>Os elementos descritos no texto, a respeito da territorialização da produção, demonstram que há um</p>', 'A', 'cerco aos camponeses, inviabilizando a manutenção das condições para a vida.', 'descaso aos latifundiários, impactando a plantação de alimentos para a exportação.', 'desprezo ao assalariado, afetando o engajamento dos sindicatos para o trabalhador.', 'desrespeito aos governantes, comprometendo a criação de empregos para o lavrador.', 'assédio ao empresariado, dificultando o investimento de maquinários para a produção.'),
(121, 'ENEM', '<p>TEXTO I</p><p>Com uma população de 25 milhões de habitantes (cerca de 60% de minorias muçulmanas, principalmente da etnia Uigur), Xinjiang é uma região estratégica para a China. Faz fronteira com oito países, é uma artéria crucial do megaprojeto de infraestrutura chinês Cinturão e Rota e tem as maiores reservas nacionais de carvão e gás natural.</p><p>NINIO, M. Disponível em: https://oglobo.globo.com. Acesso em: 5 out. 2021 (adaptado).</p><p><br></p><p>TEXTO II</p><p>Dentre as províncias da Região Oeste, Xinjiang se destaca ao receber mais de 1,7 milhão de migrantes entre 2000 e 2010. O principal motivo desse fluxo migratório é que o governo fornece subsídios à população visando aumentar a proporção de chineses da etnia Han em relação à população local de etnias turca e muçulmana.</p><p>ALVES, F.; TOYOSHIMA, S. Disparidade socioeconômica e fluxo migratório chinês: interpretação de eventos contemporâneos segundo os clássicos do desenvolvimento. Revista de Economia Contemporânea, n. 1, jan.-abr. 2017 (adaptado).</p><p><br></p><p>A política demográfica para a província mencionada nos textos é parte da seguinte ação estratégica do governo chinês:</p><p><br></p>', 'E', 'Promover a ocupação rural.', 'Favorecer a liberdade religiosa.', 'Descentralizar a gestão pública.', 'Incentivar a pluralidade cultural.', ' Assegurar a integridade territorial.'),
(122, 'ENEM', '<p>Enormes alto-falantes sul-coreanos instalados na fronteira com o Norte costumavam transmitir desde canções em estilo K-pop (como é chamado o pop sul-coreano) até boletins climáticos e noticiário crítico ao vizinho comunista. O Norte costuma praticar atividade semelhante, transmitindo por seus alto-falantes discursos críticos a Seul e aliados. Durante os anos 1980, o governo sul-coreano construiu um mastro de 97 metros de altura para hastear sua bandeira no povoado de Daesong-dong, na fronteira com o Norte. O Norte respondeu com a construção de um mastro ainda mais alto (160 m) na cidade fronteiriça de Gijung-dong. “Essas demonstrações são uma válvula de escape competitiva e importante entre os dois lados, fora de um possível conflito militar”, diz o analista Ankit Panda.</p><p>TAN, Y. Disputa de mastros e alto-falantes com K-pop: as pequenas picuinhas do conflito</p><p>entre as Coreias. Disponível em: www.bbc.com. Acesso em: 7 nov. 2021 (adaptado).</p><p><br></p><p>Os atos de competição citados têm suas origens históricas vinculadas a um contexto de</p><p><br></p>', 'C', 'domínio cultural-identitário de atores sociais.', 'disputas étnico-raciais de povos tradicionais.', 'divergências político-ideológicas de agentes estatais.', 'imposição econômico-financeira de empresas privadas.', ' protestos ecológico-sustentáveis de entidades ambientais.'),
(123, 'ENEM', '<p>Seda, madeiras aromáticas e têxteis, obras de arte, lã, cristais e muitas, muitas peças de porcelana chegaram ao Brasil ao longo dos séculos XVII e XVIII. A opulência proporcionada pelo ouro fez com que esses itens fossem ainda mais presentes em cidades mineiras como Ouro Preto, Mariana e Sabará. Esses objetos inspiraram a criação das chinesices, termo que designa um tipo de arte que evoca motivos chineses, presentes em várias igrejas barrocas de Minas Gerais. No Brasil, é bem provável que a inspiração para as pinturas nas igrejas barrocas com pássaros, elefantes, tigres, mandarins e pagodes tenha sido tirada de gravuras, tecidos, móveis e, principalmente, das porcelanas chinesas que circulavam livremente em uma sociedade enriquecida pelo comércio do ouro e pedras preciosas.</p><p>MARIUZZO, P. Estudos interdisciplinares ampliam conhecimento sobre chinesice no barroco mineiro. Disponível em: http://cienciaecultura.bvs.br.</p><p>Acesso em: 23 nov. 2021 (adaptado).</p><p><br></p><p>O desenvolvimento do processo artístico descrito no texto foi possível pelo(a)</p><p><br></p>', 'B', 'representação arquitetônica.', 'intercâmbio transcontinental.', 'dependência econômica.', 'intervenção estatal.', 'padrão estético.'),
(124, 'ENEM', '<p>Txai Suruí, liderança da Juventude Indígena, profere seu discurso na abertura da COP-26</p><p>“O clima está esquentando, os animais estão desaparecendo, os rios estão morrendo e nossas plantações não florescem como no passado. A Terra está falando: ela nos diz que não temos mais tempo.”</p><p>VICK, M. Quais são as conquistas do movimento indígena na COP-26. Disponível em: www.nexojornal.com.br. Acesso em: 10 nov. 2021 (adaptado).</p><p>O discurso da líder indígena explicita um problema global relacionado ao(à)</p><p><br></p>', 'D', ' manejo tradicional.', 'reciclagem residual.', 'consumo consciente.', 'exploração predatória.', 'reaproveitamento energético.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(125, 'ENEM', '<p><img src=\"data:image/png;base64,\"></p><p>Nas reportagens publicadas sobre a inauguração do Museu de Arte de São Paulo, em 1947, quando ele ainda ocupava um edifício na rua Sete de Abril, Lina Bo Bardi não foi mencionada nenhuma vez. A arquiteta era responsável pelo projeto do museu que mudaria para sempre a posição de São Paulo no circuito mundial das artes. Mas não houve nenhum registro disso. O louvor se concentrou em seu marido e parceiro profissional, o respeitado crítico de arte Pietro Maria Bardi. Passados 75 anos, a mulher então ignorada recebeu um Leão de Ouro póstumo, a maior homenagem da Bienal de Arquitetura de Veneza, e tem agora sua história contada em duas biografias de peso, que procuram destrinchar uma carreira marcada pela ousadia e pela contradição.</p><p>PORTO, W. Lina Bo Bardi tem sua arquitetura contraditória destrinchada em biografias. Disponível em: www1.folha.uol.com.br. Acesso em: 10 nov. 2021 (adaptado).</p><p><br></p><p>As transformações pelas quais passaram as sociedades ocidentais e que possibilitaram o reconhecimento recente do trabalho da arquiteta mencionada no texto foram resultado das mobilizações sociais pela</p>', 'A', 'equidade de gênero.', 'liberdade de expressão.', 'admissibilidade de voto.', 'igualdade de oportunidade.', 'reciprocidade de tratamento.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(126, 'ENEM', '<p>TEXTO I</p><p>Como é horrivel ver um filho comer e perguntar: “Tem mais?” Esta palavra “tem mais” fica oscilando dentro do cerebro de uma mãe que olha as panela e não tem mais.</p><p>JESUS, C. M. Quarto de despejo: diário de uma favelada. São Paulo: Ática, 2014.</p><p>TEXTO II</p><p>A experiência de ver os filhos com fome na década de 1950, descrita por Carolina, é vivida no Brasil de 2021 por uma moradora de Petrolândia, em Pernambuco. “Eu trabalhava de ajudante de cabeleireira, mas a moça que tinha o salão fechou. Eu vinha me sustentando com o auxílio que tinha, mas agora eu não fui contemplada. Às vezes as pessoas me ajudam com alimentos para os meus filhos. De vez em quando, eu acho algum bico para fazer, mas é muito raro. Tem dias que não tenho nem o leite da minha bebê.”</p><p>CARRANÇA, T. “Até o feijão nos esqueceu”: o livro de 1960 que poderia ter sido escrito nas favelas de 2021. Disponível em: www.bbc.com. Acesso em: 6 out. 2021 (adaptado).</p><p><br></p><p>Considerando  a  realidade  brasileira,  os  textos  se</p><p>aproximam ao apresentarem uma reflexão sobre o(a)</p><p><br></p>', 'A', 'recorrência da miséria.', 'planejamento da saúde.', 'superação da escassez.', 'constância da economia.', 'romantização da carência.'),
(127, 'ENEM', '<p>No sul da Bahia, desde o século XVIII, tem-se registros de um tipo de sistema agroflorestal. Até hoje, esse sistema é característica marcante da paisagem da região, conhecido como cabruca, que consiste no cultivo do cacau à sombra do dossel da floresta nativa. Esse sistema de cultivo do cacau (graças à tolerância da espécie à sombra) é considerado amigável para a vida silvestre, pois apresenta superioridade em termos de conservação da biodiversidade quando comparado com outras plantações tropicais (monoculturas de dendê, seringa ou café), agricultura ou pastagens.</p><p>SOLLBERG, I.; SCHIAVETTI, A.; MORAES, M. E. B. Manejo agrícola no</p><p>Refúgio de Vida Silvestre de Una: agroflorestas como uma perspectiva</p><p>de conservação. Revista Árvore, n. 2, 2014 (adaptado).</p><p><br></p><p>A prática produtiva apresentada é um exemplo de </p>', 'B', 'difusão comercial de lavouras temporárias.', 'utilização sustentável dos recursos naturais.', 'ampliação tecnológica da pecuária intensiva.', 'padronização alimentar dos povos tradicionais.', 'modernização logística de plantios convencionais.'),
(128, 'ENEM', '<p>O masseiro, a mulher, e quatro filhos, dormindo numa tapera de quatro paredes de caixão, coberta de zinco. A água do mangue, na maré cheia, ia dentro de casa. Os maruins de noite encalombavam o corpo dos meninos. O mangue tinha ocasião que fedia, e os urubus faziam ponto por ali atrás dos petiscos. Perto da rua lavavam couro de boi, pele de bode para o curtume de um espanhol. Morria peixe envenenado, e quando a maré secava, os urubus enchiam o papo, ciscavam a lama, passeando banzeiros pelas biqueiras dos mocambos no Recife.</p><p>RÊGO, J. L. O moleque Ricardo. Rio de Janeiro: J. Olympio, 1966 (adaptado).</p><p><br></p><p>A aglomeração urbana representada no texto resulta em</p>', 'C', 'conservação do meio rural.', 'crescimento da vegetação ciliar.', 'interferência do espaço geográfico.', 'equilíbrio do ambiente das cidades.', 'controle da proliferação dos animais.'),
(129, 'ENEM', '<p>Elas foram as pioneiras dos direitos das mulheres no Afeganistão. Defensoras ferrenhas da lei, buscaram justiça para os mais marginalizados. Mas, agora, mais de 220 juízas afegãs estão escondidas por medo de retaliação sob o regime do Talibã. Uma delas condenou centenas de homens por violência contra as mulheres, incluindo estupro, assassinato e tortura. Mas poucos dias depois que o Talibã assumiu o controle de sua cidade e milhares de criminosos condenados foram libertados da prisão, as ameaças de morte começaram. O país sempre foi considerado um dos lugares mais difíceis e perigosos do mundo para as mulheres. De acordo com estudos de organizações não governamentais, cerca de 87% das mulheres e meninas serão vítimas de abuso durante a vida.</p><p>Disponível em: https://g1.globo.com. Acesso em: 12 out. 2021 (adaptado).</p><p><br></p><p>O texto evidencia situação representativa de</p>', 'D', 'afronta às estruturas sociais.', 'desprezo aos valores religiosos.', 'transgressão às normas morais.', 'desrespeito à dignidade humana.', 'oposição aos princípios hierárquicos.');
INSERT INTO `questoes` (`id_questao`, `nome`, `descricao`, `alternativa_certa`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`) VALUES
(130, 'ENEM', '<p>Na tirinha de Mauricio de Sousa, os personagens Cebolinha e Cascão fazem uma brincadeira utilizando duas latas</p><p>e um barbante. Ao perceberem que o som pode ser transmitido através do barbante, resolvem alterar o comprimento do</p><p>barbante para ficar cada vez mais extenso. As demais condições permaneceram inalteradas durante a brincadeira.</p><p><img src=\"data:image/png;base64,\"></p><p>SOUSA, M. Disponível em: www.monica.com.br. Acesso em: 2 out. 2012 (adaptado).</p><p><br></p><p>Na prática, à medida que se aumenta o comprimento do barbante, ocorre a redução de qual característica da onda sonora?</p>', 'C', 'Altura.', 'Período.', 'Amplitude.', 'Velocidade.', 'Comprimento de onda.');

