INSERT INTO `rocha` (`idrocha`, `nome`, `descricao`, `img`, `idcat`, `sugestao`, `3d`, `idusuario`) VALUES
(2, 'Granito Azul', '<p class=\"dark\">&lt;p&gt;Granito e riolito, juntamente com suas rochas correlatas (como tonalito e granodiorito), são as mais amplamente distribuídas das rochas ígneas que compõem a crosta continental. Os granitos são formados pelo resfriamento do magma em profundidade, por isso são denominados de rochas plutônicas ou intrusivas. O magma que dá origem aos granitos é produto direto da fusão parcial da crosta terrestre, em zonas tectonicamente ativas, promovendo assim sua reciclagem. A composição química dos magmas graníticos reflete a composição química da própria crosta. O magma granítico é relativamente mais frio (700 – 900 °C) que o magma basáltico (1000 – 1200 °C), e também mais rico em sílica (SiO2 &amp;gt; 63%), o que lhe confere uma característica menos fluida, mais viscosa, dificultando assim que chegue até à superfície, fazendo com que, em geral, cristalize em profundidade.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;O granito é formado quando o magma resfria lentamente em porções profundas da crosta continental. O lento resfriamento do magma no interior da crosta permite promover o crescimento dos minerais, desenvolvendo uma textura denominada de fanerítica, na qual os minerais são distinguíveis a olho nu (&amp;gt; 1mm). Riolito é o equivalente vulcânico do granito, ou seja, resultado do resfriamento e cristalização do magma que alcança a superfície terrestre, gerando desse modo uma rocha de mesma composição mineralógica, mas com textura afanítica, ou seja, com grãos muito finos não visíveis a olho nu (&amp;lt; 1mm).&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Feldspato alcalino, quartzo e plagioclásio perfazem geralmente mais de 80% do granito. Por isso, o granito é considerado uma rocha félsica, ou seja, uma rocha clara. Feldspato alcalino pode formar grandes cristais (megacristais), que se destacam em relação aos outros constituintes, conferindo ao granito uma textura porfirítica. Em geral, a cor do feldspato alcalino, branco, cinza, rosa, vermelho ou verde, determina a cor da rocha. Quando ocorre o predomínio do feldspato alcalino sobre o plagioclásio a rocha é denominada de sienogranito, já se o predomínio é do plagioclásio a rocha é denominada de monzogranito. Muscovita, biotita e anfibólio também são minerais comuns nessas rochas. Alguns granitos também podem conter piroxênio ou granada. Os minerais acessórios mais comuns nessas rochas são apatita, zircão, monazita, titanita, allanita, magnetita e ilmenita.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Pegmatito e aplito são rochas de mesma composição do granito, mas apresentam, respectivamente, grãos predominantemente muito grossos (&amp;gt; 3 cm) e finos (≤ 1mm).&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Granitos são rochas duras e resistentes amplamente utilizadas nas construções (brita, pavimentos, revestimentos de pisos e fachadas, e ornamentos) e monumentos.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;O intemperismo promove a alteração química e física dos granitos quando expostos em superfície. A alteração dessas rochas em resposta à intempérie pode levar a formação de grandes blocos arredondados de granito soltos na superfície dos terrenos, resultado de esfoliação esferoidal, que promove a formação de estruturas concêntricas assemelhadas a cascas de cebola. Os blocos arredondados de granito podem se espalhar por uma extensa área, formando no relevo um mar de matacões, que quando presentes denunciam a natureza do substrato rochoso.&lt;/p&gt;</p>', 'Granito.png', 1, 0, 'Granitoazul.glb', 1),
(3, 'Arenito', '<p class=\"light\">Arenito ou grés é uma rocha sedimentar que resulta da compactação e litificação de um material granular da dimensão das areias. O arenito é composto normalmente por quartzo, mas pode ter quantidades apreciáveis de feldspatos, micas e/ou impurezas. É a presença e tipo de impurezas que determina a coloração dos arenitos; por exemplo, grandes quantidades de óxidos de ferro fazem esta rocha vermelha. O arenito é usado em diversas construções civis.</p><p class=\"light\"><br></p><p class=\"light\">O arenito é depositado em ambiente continental, nos rios e lagos, ou em ambiente marinho, em praias, deltas ou nas sequências turbidíticas do talude continental.</p><p class=\"light\"><br></p><p class=\"light\">Os arenitos são rochas lapidificadas constituídas por areias aglutinadas por um cimento natural, que geralmente caracteriza a rocha. São rochas também designadas por grés e muitas vezes são classificadas pela natureza do cimento. Os arenitos argilosos têm um cimento constituído por argilas.</p><p class=\"light\"><br></p><p class=\"light\">Os arenitos calcários são fundidos por rochas magmáticas e granito de cimento, em geral, de carbonato de cálcio (calcite), que faz efervescência fácil com os ácidos. Se o cimento do arenito for dolomite (carbonato de cálcio e magnésio), a efervescência é menos nítida.</p><p class=\"light\"><br></p><p class=\"light\">Economicamente, o arenito pode ter interesse se for associado a jazidas minerais do tipo plácer, onde os metais interessantes se depositam como os grãos de areia, integrando depois o arenito.</p><p class=\"light\"><br></p><p class=\"light\">Em Sapucaia do Sul, município brasileiro do estado do Rio Grande do Sul, próximo a Porto Alegre, há uma grande mineração de arenito, pedras que são extraídas, recortadas e que servem à construção civil, como pedras de alicerce. O arenito encontrado naquela região é do tipo eólico, pertencente à Formação Botucatu. Formou-se pela compactação de areias de um vasto deserto arenoso que existiu onde é hoje a América do Sul no período Triássico e que foi coberto pelas lavas basálticas da Formação Serra Geral.</p><p class=\"light\"><br></p><p class=\"light\">Os arenitos são rochas silicosas sedimentares, constituídos por grãos de sílica ou quartzo, ligados por cimento silicoso, argiloso ou calcário. São empregados em revestimentos, resistindo bem aos ataques de agentes agressivos da atmosfera.</p>', 'arenito.png', 3, 1, 'arenito.glb', 10),
(10, 'Ardósia', '<p class=\"light\">A ardósia é uma rocha metamórfica sílico-argilosa formada pela transformação da argila sob pressão e temperatura, endurecida em finas lamelas. De baixo grau metamórfico, a ardósia é formada sob as menores pressões e temperaturas dentre as rochas metamórficas.</p>', 'ardósia.png', 2, 0, '', 4),
(35, 'Quartzo', '<p class=\"light\">&lt;p class=\"light\"&gt;&amp;lt;p class=\"dark\"&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/p&amp;gt;&lt;/p&gt;</p>', 'Quartzojpeg', 2, 0, 'Quartzo-3d.', 1);

